्शन गर्दछ। वर्गहरू र ट्यागहरू जस्तै, ट्याक्सोनोमीमा टर्महरू छन् जुन तपाईँले वर्गीकरण गर्न प्रयोग गर्नुहुन्छ। उदाहरणका लागि: "कला" नामक ट्याक्सोनोमीमा "आधुनिक" र "१८ औं शताब्दी" जस्ता धेरै शब्दहरू हुन सक्छन्। यो टेम्प्लेटले फलब्याकको रूपमा काम गर्नेछ जब थप विशिष्ट टेम्प्लेट (जस्तै, ट्याक्सोनोमी: कला) फेला पार्न सकिँदैन।','Displays your site\'s Privacy Policy page.'=>'तपाईँको साइटको गोपनीयता नीति पृष्ठ देखाउँछ।','Displays when a visitor views a non-existent page, such as a dead link or a mistyped URL.'=>'कुनै आगन्तुकले अवस्थित नभएको पृष्ठ, जस्तै निष्क्रिय लिङ्क वा गलत टाइप गरिएको युआरएल हेर्दा प्रदर्शित हुन्छ।','Displays a single author\'s post archive. This template will serve as a fallback when a more specific template (e.g. Author: Admin) cannot be found.'=>'एकल लेखकको पोस्ट अभिलेख प्रदर्शन गर्दछ। यो टेम्प्लेटले फलब्याकको रूपमा काम गर्नेछ जब थप विशिष्ट टेम्प्लेट (जस्तै, लेखक: व्यवस्थापक) फेला पार्न सकिँदैन।','Displays any archive, including posts by a single author, category, tag, taxonomy, custom post type, and date. This template will serve as a fallback when more specific templates (e.g. Category or Tag) cannot be found.'=>'एकल लेखक, वर्ग, ट्याग, वर्गीकरण, अनुकूलन पोस्ट प्रकार, र मिति द्वारा पोस्ट सहित कुनै पनि अभिलेख प्रदर्शन गर्दछ। थप विशिष्ट टेम्प्लेटहरू (जस्तै, कोटी वा ट्याग) फेला पार्न नसक्दा यो टेम्प्लेटले फलब्याकको रूपमा काम गर्नेछ।','Displays a post category archive. This template will serve as a fallback when a more specific template (e.g. Category: Recipes) cannot be found.'=>'पोस्ट वर्ग अभिलेख प्रदर्शन गर्दछ। यो टेम्प्लेटले फलब्याकको रूपमा काम गर्नेछ जब थप विशिष्ट टेम्प्लेट (जस्तै, वर्ग: रेसिपीहरू) फेला पार्न सकिँदैन।','Used as a fallback template for all pages when a more specific template is not defined.'=>'अधिक विशिष्ट टेम्प्लेट परिभाषित नभएको बेला सबै पृष्ठहरूको लागि फलब्याक टेम्प्लेटको रूपमा प्रयोग गरिन्छ।','Displays the latest posts as either the site homepage or as the "Posts page" as defined under reading settings. If it exists, the Front Page template overrides this template when posts are shown on the homepage.'=>'नवीनतम पोस्टहरू या त साइट गृहपृष्ठ वा "पोस्ट पृष्ठ" को रूपमा पठन सेटिङहरू अन्तर्गत परिभाषित रूपमा प्रदर्शन गर्दछ। यदि यो अवस्थित छ भने, होमपेजमा पोस्टहरू देखाइँदा पहिलो पृष्ठ टेम्प्लेटले यो टेम्प्लेटलाई ओभरराइड गर्छ।','Displays any single entry, such as a post or a page. This template will serve as a fallback when a more specific template (e.g. Single Post, Page, or Attachment) cannot be found.'=>'कुनै एकल प्रविष्टि, जस्तै पोस्ट वा पृष्ठ प्रदर्शन गर्दछ। अधिक विशिष्ट टेम्प्लेट (जस्तै, एकल पोस्ट, पृष्ठ, वा संलग्न) फेला पार्न नसक्दा यो टेम्प्लेटले फलब्याकको रूपमा काम गर्नेछ।','Displays your site\'s homepage, whether it is set to display latest posts or a static page. The Front Page template takes precedence over all templates.'=>'तपाईँको साइटको मुखपृष्ठमा प्रदर्शन हुन्छ, चाहे यो नवीनतम पोस्टहरू वा स्थिर पृष्ठ प्रदर्शन गर्न सेट गरिएको होस्। &#8216;मुखपृष्ठ&#8217; टेम्प्लेटले सबै टेम्प्लेटहरूमा प्राथमिकता लिन्छ।','Block pattern categoryBanners'=>'ब्यानरहरू','Block pattern categoryPosts'=>'पोस्टहरू','Block pattern categoryTeam'=>'टिम','Block pattern categoryAbout'=>'बारेमा','block keywordpage'=>'पृष्ठ','block titlePage List Item'=>'पृष्ठ सूची आइटम','block descriptionDisplays a page inside a list of all pages.'=>'सबै पृष्ठहरूको सूची भित्र एक पृष्ठ प्रदर्शन गर्दछ','block descriptionThe author name.'=>'लेखकको नाम।','block titleAuthor Name'=>'लेखकको नाम','Style Variations'=>'स्टाइल विविधताहरू','Position'=>'स्थिति','Sticky'=>'स्टिकी','https://wordpress.org/documentation/article/reset-your-password/'=>'https://wordpress.org/documentation/article/reset-your-password/','https://wordpress.org/documentation/article/site-editor/'=>'https://wordpress.org/documentation/article/site-editor/','Unknown bookmark name.'=>'अज्ञात पृष्ठसङ्केत नाम।','Too many bookmarks: cannot create any more.'=>'धेरै पृष्ठसङ्केतहरू: थप सिर्जना गर्न सकिँदैन।','Invalid attribute name.'=>'अमान्य विशेषता नाम।','Too many calls to seek() - this can lead to performance issues.'=>'धेरै पटक seek() लाई कल गरियो - यसले कार्यसम्पादन समस्याहरू निम्त्याउन सक्छ।','The block types which can use this pattern.'=>'यो प्याटर्न प्रयोग गर्न सक्ने ब्लकका प्रकारहरू।','When using the %1$s constant, make sure to set these globals to an array: %2$s.'=>'%1$s स्थिर प्रयोग गर्दा, यी ग्लोबलहरूलाई एरेमा सेट गर्न निश्चित गर्नुहोस्: %2$s।','Download file'=>'फाइल डाउनलोड गर्नुहोस्','The category description, in human readable format.'=>'वर्ग विवरण, मानव पठनीय ढाँचामा।','Please check that the %s PHP extension is installed and enabled.'=>'कृपया जाँच गर्नुहोस् कि %s पिएचपी एक्सटेन्सन स्थापित र सक्षम छ।','An array of template types where the pattern fits.'=>'प्याटर्न फिट हुने टेम्प्लेट प्रकारहरूको एरे।','Array of column names to be searched.'=>'खोजी गर्नुपर्ने कोलम नामहरूको एरे।','The query argument must be an array or a tag name.'=>'क्वेरी आर्गुमेन्ट एउटा एरे वा ट्याग नाम हुनुपर्छ।','Warning: %1$s expects parameter %2$s (%3$s) to be a %4$s, %5$s given.'=>'चेतावनी: %1$s ले %2$s (%3$s) प्यारामिटर %4$s हुने अपेक्षा गर्छ तर %5$s दिइएको छ।','https://wordpress.org/documentation/article/manage-wordpress-widgets/'=>'https://wordpress.org/documentation/article/manage-wordpress-widgets/','Sorry, replies to unapproved comments are not allowed.'=>'माफ गर्नुहोस्, अस्वीकृत टिप्पणीहरूमा जवाफ दिन अनुमति छैन।','Arguments cannot be prepared as both an Identifier and Value. Found the following conflicts: %s'=>'आर्गुमेन्टहरूलाई पहिचानकर्ता र मानको रूपमा तयार गर्न सकिएन। निम्न द्वन्दहरू भेटियो: %s','The image already has the requested size.'=>'तस्बिर पहिले नै अनुरोध गरिएको आकारमा छ।','Values for the input array must be either objects or arrays.'=>'इनपुट एरेको मानहरू अब्जेक्ट वा एरे हुनै पर्छ।','Block pattern categoryContact'=>'सम्पर्क','Introduce yourself.'=>'आफ्नो परिचय दिनुहोस्।','Showcase your latest work.'=>'आफ्नो पछिल्लो काम देखाउनुहोस्',': %s'=>': %s','Block pattern categoryPortfolio'=>'पोर्टफोलियो','Block pattern categoryTestimonials'=>'प्रशंसापत्रहरू','Block pattern categoryServices'=>'सेवाहरू','untitled post %s'=>'शीर्षकविहीन पोस्ट %s','Untitled post %d'=>'शीर्षकविहीन पोस्ट %d','Sections whose purpose is to trigger a specific action.'=>'खण्डहरू जसको उद्देश्य विशेष कार्य ट्रिगर गर्नु हो।','Different layouts for displaying images.'=>'तस्बिर प्रदर्शन गर्नका लागि विभिन्न लेआउटहरू।','https://wordpress.org/documentation/'=>'https://wordpress.org/documentation/','Different layouts containing video or audio.'=>'भिडियो वा अडियो भएको विभिन्न लेआउटहरू।','Share reviews and feedback about your brand/business.'=>'आफ्नो ब्रान्ड/व्यवसाय बारे समीक्षा र प्रतिक्रिया साझेदारी गर्नुहोस्।','A variety of footer designs displaying information and site navigation.'=>'जानकारी र साइट नेभिगेसन प्रदर्शन गर्ने विभिन्न फुटर डिजाइनहरू।','There&#8217;s no content to show here yet.'=>'यहाँ देखाउनको लागि अझै कुनै सामग्री छैन।','Patterns containing mostly text.'=>'धेरैजसो अक्षरहरू भएका प्याटर्नहरू।','Multi-column patterns with more complex layouts.'=>'जटिल लेआउटहरू भएका बहु-कोलम प्याटर्नहरू।','Display your latest posts in lists, grids or other layouts.'=>'तपाईँका नवीनतम पोस्टहरू सूची, ग्रिड वा अन्य लेआउटमा प्रदर्शन गर्नुहोस्।','Patterns that contain buttons and call to actions.'=>'प्याटर्नहरू जसमा बटनहरू र सन्देश जसले तपाईँका दर्शकहरूलाई के गर्ने भनेर बताउँछ।','Briefly describe what your business does and how you can help.'=>'तपाईँको व्यवसायले के गर्छ र तपाईँ कसरी मद्दत गर्न सक्नुहुन्छ सङ्क्षिप्त रूपमा वर्णन गर्नुहोस्।','Display your contact information.'=>'तपाईँको सम्पर्क विवरण देखाउनुहोस्।','A variety of header designs displaying your site title and navigation.'=>'तपाईँको साइट शीर्षक र नेभिगेसन प्रदर्शन गर्ने विविध हेडर डिजाइनहरू।','A set of high quality curated patterns.'=>'क्युरेट गरिएका उच्च गुणस्तरीय प्याटर्नहरूको सेट।','Block pattern categoryCall to Action'=>'कार्यार्थ आह्वान','A variety of designs to display your team members.'=>'तपाईँको टिमका सदस्यहरू प्रदर्शन गर्न विभिन्न डिजाइनहरू।','User queries should not be run before the %s hook.'=>'प्रयोगकर्ता क्वेरीहरू %s हुक भन्दा अघि चलाउनु हुँदैन।','The %s argument must be a string or a string array.'=>'%s को आर्गुमेन्ट स्ट्रिङ वा स्ट्रिङको एरे हुनुपर्छ।','Sorry, you are not allowed to view terms for this post.'=>'माफ गर्नुहोला, यहाँलाई यस पोस्टको टर्महरु हेर्ने अनुमति छैन।','Raw size value must be a string, integer, or float.'=>'कोरा साइजको मान अक्षर, पूर्णाङ्क वा दशमलवमा हुनुपर्छ।','block titleComments Page Numbers'=>'टिप्पणीहरुको पेज नम्बरहरु','block titleCategories List'=>'वर्गहरूको सूची','block descriptionCreate a list item.'=>'सूची आइटम सिर्जना गर्नुहोस्।','block titleComments Next Page'=>'टिप्पणीहरूको अर्को पृष्ठ','block titleComments Previous Page'=>'टिप्पणीहरूको अघिल्लो पृष्ठ','block titleList item'=>'सूची आइटम','block titleComments'=>'टिप्पणीहरू','Single item: %s'=>'एकल आइटम: %s','Default template'=>'पूर्वनिर्धारित टेम्प्लेट','%s comment'=>'%s टिप्पणी' . "\0" . '%s टिप्पणीहरू','Site Domain (subdomain only):'=>'साइट डोमेन (सबडोमेन मात्र):','Create a site or only a username:'=>'एउटा साइट वा केवल एक युजरनेम सिर्जना गर्नुहोस्:','Site Name (subdirectory only):'=>'साइटको नाम (सबडाइरेक्टरी मात्र):','There doesn\'t seem to be a %s file. It is needed before the installation can continue.'=>'त्यहाँ %s फाइल भएको देखिँदैन। स्थापना जारी राख्न सक्नु अघि यो आवश्यक छ।','The date and time the preferences were updated.'=>'मिति र समय अभिरुची अपडेट गरियो।','$store must be an instance of WP_Style_Engine_CSS_Rules_Store'=>'$store WP_Style_Engine_CSS_Rules_Store को एउटा उदाहरण हुनुपर्छ','Revisions not enabled.'=>'संशोधन सक्षम गरिएको छैन।','The icon for the post type.'=>'पोस्ट प्रकारको लागि आइकन।','If the value is a string, the value will be used as the archive slug. If the value is false the post type has no archive.'=>'यदि मान स्ट्रिङ हो भने, मान अभिलेख स्लगको रूपमा प्रयोग गरिनेछ। यदि मान गलत छ भने पोस्ट प्रकारको कुनै अभिलेख छैन।','Public facing script handle. DEPRECATED: Use `view_script_handles` instead.'=>'सार्वजनिक अनुहार लिपि ह्यान्डल। बहिष्कृत: यसको सट्टा `view_script_handles` प्रयोग गर्नुहोस्','The template prefix for the created template. This is used to extract the main template type, e.g. in `taxonomy-books` extracts the `taxonomy`'=>'सिर्जना गरिएको टेम्प्लेटको लागि टेम्प्लेट उपसर्ग। यो मुख्य टेम्प्लेट प्रकार निकाल्न प्रयोग गरिन्छ, उदाहरणका लागि। \'वर्गीकरण-पुस्तकहरू\' मा \'वर्गीकरण\' निकाल्छ','The slug of the template to get the fallback for'=>'फलब्याक प्राप्त गर्न टेम्प्लेटको स्लग','Public facing and editor script handle. DEPRECATED: Use `script_handles` instead.'=>'सार्वजनिक अनुहार र सम्पादक लिपि ह्यान्डल। बहिष्कृत: यसको सट्टा `script_handles` प्रयोग गर्नुहोस्।','Editor script handle. DEPRECATED: Use `editor_script_handles` instead.'=>'सम्पादक स्क्रिप्ट ह्यान्डल। बहिष्कृत: यसको सट्टा `editor_script_handles` प्रयोग गर्नुहोस्।','Indicates if a template is custom or part of the template hierarchy'=>'टेम्प्लेट कस्टम हो वा टेम्प्लेट पदक्रमको भाग हो भन्ने सङ्केत गर्छ','Public facing and editor style handle. DEPRECATED: Use `style_handles` instead.'=>'सार्वजनिक अनुहार र सम्पादक स्टाइल ह्यान्डल। बहिष्कृत: यसको सट्टा `style_handles` प्रयोग गर्नुहोस्।','Editor style handle. DEPRECATED: Use `editor_style_handles` instead.'=>'सम्पादक स्टाइल ह्यान्डल। हटाइएको: यसको सट्टा `editor_style_handles` प्रयोग गर्नुहोस्।','Whether a theme uses block-based template parts.'=>'थिमले ब्लक-आधारित टेम्प्लेट भागहरू प्रयोग गर्छ कि गर्दैन।','Whether the theme disables generated layout styles.'=>'थिमले उत्पन्न लेआउट स्टाइलहरू अक्षम गर्छ कि गर्दैन।','REST API %1$s should be an array of arrays. Non-array value detected for %2$s.'=>'REST API %1$s एरेहरूको एर्रे हुनुपर्छ। %2$s को लागि गैर-एरे मान पत्ता लाग्यो।','An array of post types that the pattern is restricted to be used with.'=>'पोस्ट प्रकारहरूको एरे जुनमा प्याटर्न प्रयोग गर्न प्रतिबन्धित छ।','If you are the owner of this network please check that your host&#8217;s database server is running properly and all tables are error free.'=>'तपाईँ यस नेटवर्कको मालिक हुनुहुन्छ भने होस्टको डाटाबेस ठीक चलिरहेको छ र सबै टेबुलहरू त्रुटिमुक्त छन् भनेर जाँच गर्नुहोस्।','*'=>'*','<strong>Conflicting values for the constants %1$s and %2$s.</strong> The value of %2$s will be assumed to be your subdomain configuration setting.'=>'<strong>अचलहरू %1$s र %2$s को लागि विरोधाभासी मानहरू।</strong> %2$s को मान तपाईंको सबडोमेन कन्फिगरेसन सेटिङ मानिनेछ।','Logged in as %1$s. <a href="%2$s">Edit your profile</a>. <a href="%3$s">Log out?</a>'=>'%1$s को रूपमा लगइन गरिएको छ। <a href="%2$s">आफ्नो प्रोफाइल सम्पादन गर्नुहोस्</a>। <a href="%3$s">लगआउट गर्नुहुन्छ?</a>','%sX-Large'=>'%sX-ठूलो','%sX-Small'=>'%sX-सानो','There has been a critical error on this website. Please reach out to your site administrator, and inform them of this error for further assistance.'=>'यस वेबसाइटमा एउटा महत्वपूर्ण त्रुटि भएको छ। कृपया आफ्नो साइट प्रशासकलाई सम्पर्क गर्नुहोस्, र थप सहायताको लागि उनीहरूलाई यो त्रुटिको बारेमा सूचित गर्नुहोस्।','When checking for the %s capability, you must always check it against a specific user.'=>'%s क्षमताको लागि जाँच गर्दा, तपाईंले सधैँ एक विशिष्ट प्रयोगकर्ता विरुद्ध जाँच गर्नुपर्छ।','When checking for the %s capability, you must always check it against a specific comment.'=>'%s क्षमताको लागि जाँच गर्दा, तपाईंले सधैँ कुनै विशेष टिप्पणी विरुद्ध जाँच गर्नुपर्छ','Your %1$s file uses a dynamic value (%2$s) for the path at %3$s. However, the value at %3$s is also a dynamic value (pointing to %4$s) and pointing to another dynamic value is not supported. Please update %3$s to point directly to %4$s.'=>'तपाईंको %1$s फाइलले %3$s मा पथको लागि गतिशील मान (%2$s) प्रयोग गर्दछ। यद्यपि, %3$s मा भएको मान पनि एक गतिशील मान हो (%4$s तर्फ पोइन्ट गर्दै) र अर्को डायनामिक मानमा पोइन्ट गर्ने काम समर्थित छैन। कृपया %3$s लाई सिधै %4$s मा पोइन्ट गर्न अपडेट गर्नुहोस्।','put your unique phrase here'=>'put your unique phrase here','Cache key must not be an empty string.'=>'क्यास की खाली स्ट्रिङ हुनुहुँदैन।','Cache key must be an integer or a non-empty string, %s given.'=>'क्यास की एक पूर्णाङ्क वा गैररिक्त स्ट्रिङ हुनुपर्नेमा %s दिइएको छ।','When checking for the %s capability, you must always check it against a specific term.'=>'&#8216;%s&#8217; क्षमताका लागि जाँच गर्दा तपाईँले यसलाई जहिले पनि निर्दिष्ट टर्मविरुद्ध जाँच गर्नुपर्छ।','Not found: %1$s (%2$s)'=>'भेटिएन: %1$s (%2$s)','Template for %s'=>'%s को लागि टेम्प्लेट','When checking for the %s capability, you must always check it against a specific post.'=>'%s क्षमताको लागि जाँच गर्दा, तपाईले सधै एक निर्धारित पोस्ट विरुध जाँच गर्नुपर्छ।','When checking for the %s capability, you must always check it against a specific page.'=>'%s क्षमताको लागि जाँच गर्दा, तपाईले सधै एक निर्धारित पोस्ट विरुध जाँच गर्नुपर्छ।','Your object cache implementation does not support flushing individual groups.'=>'तपाईँको अब्जेक्ट क्यास कार्यान्वयनले छुट्टाछुट्टै समूहहरू फ्लस गर्न समर्थन गर्दैन।','Your object cache implementation does not support flushing the in-memory runtime cache.'=>'तपाईँको अब्जेक्ट क्यास कार्यान्वयनले इन-मेमोरी रनटाइम क्यास फ्लस गर्न समर्थन गर्दैन।','Deleted author: %s'=>'मेटाइएको लेखक: %s','Cron unschedule event error for hook: %1$s, Error code: %2$s, Error message: %3$s, Data: %4$s'=>'हुकको लागि क्रोन अनुसूचित घटना त्रुटि: %1$s, त्रुटि कोड: %2$s, त्रुटि सन्देश: %3$s, डेटा: %4$s','Cron reschedule event error for hook: %1$s, Error code: %2$s, Error message: %3$s, Data: %4$s'=>'हुकको लागि क्रोन पुन: तालिका घटना त्रुटि: %1$s, त्रुटि कोड: %2$s, त्रुटि सन्देश: %3$s, डेटा: %4$s','Block pattern categoryFooters'=>'फुटरहरू','Whether a theme uses block-based templates.'=>'थिमले ब्लक-आधारित टेम्प्लेटहरू प्रयोग गर्छ कि गर्दैन।','The ID of the page that should be displayed on the front page'=>'त्यो पृष्ठको आईडी जुन मुखपृष्ठमा प्रदर्शित हुनुपर्छ','What to show on the front page'=>'मुखपृष्ठमा के देखाउने','The ID of the page that should display the latest posts'=>'पृष्ठको आईडी जसले नवीनतम पोस्टहरू प्रदर्शन गर्नुपर्छ।','File %1$s is <strong>deprecated</strong> since version %2$s with no alternative available.'=>'बिना कुनै विकल्प %2$s संस्करणबाट %1$s फाइल <strong>बहिष्कृत</strong> गरिएको छ।','File %1$s is <strong>deprecated</strong> since version %2$s! Use %3$s instead.'=>'%2$s संस्करण देखि %1$s फाइल <strong>अप्रचलित</strong> भएको छ! बरु %3$s प्रयोग गर्नुहोस् ।','Function %1$s is <strong>deprecated</strong> since version %2$s! Use %3$s instead.'=>'कार्य %1$s is <strong>बहिष्कृत</strong> संस्करण देखि %2$s!सट्टा  %3$s प्रयोग गर्नुहोस् .','Function %1$s is <strong>deprecated</strong> since version %2$s with no alternative available.'=>'बिना कुनै विकल्प %2$s संस्करणबाट %1$s फङ्कसन <strong>बहिष्कृत</strong> गरिएको छ।','block titleRead More'=>'थप पढ्नुहोस्','block descriptionDisplays the link of a post, page, or any other content-type.'=>'एउटा पोस्ट, पृष्ठ, वा कुनै अन्य प्रकारको सामग्रीको लिङ्क देखाउछ।','block descriptionContains the block elements used to render content when no query results are found.'=>'कुएरीको परिणामहरू भेटाउन नसक्दा सामग्री रेन्डर गर्न प्रयोग गरिने ब्लक एलीमेन्त्सहरु समावेश गर्दछ','block titleNo results'=>'कुनै परिणाम छैन','block descriptionThe author biography.'=>'लेखकको जीवनी।','block descriptionCreate a link that always points to the homepage of the site. Usually not necessary if there is already a site title link present in the header.'=>'एउटा लिङ्क सिर्जना गर्नुहोस् जुन सधैं साइटको गृहपृष्ठमा पोइन्ट गर्दछ। यदि हेडरमा पहिले नै साइट शीर्षक लिङ्क अवस्थित छ भने सामान्यतया आवश्यक छैन। ','block titleAuthor Biography'=>'लेखकको जीवनी','block descriptionDisplay post author details such as name, avatar, and bio.'=>'नाम, अवतार र जीवनी जस्ता पोस्ट लेखक विवरणहरू प्रदर्शन गर्नुहोस्।','block titleHome Link'=>'गृह लिङ्क','block titleComments Title'=>'टिप्पणी शीर्षक','block descriptionGather blocks in a layout container.'=>'ब्लकहरूलाई लेआउट कन्टेनरमा जम्मा गर्नु होस्','block descriptionAn advanced block that allows displaying post comments using different visual configurations.'=>'एक उन्नत ब्लक जसले विभिन्न दृश्यात्मक कन्फिगरेसनहरू प्रयोग गरेर पोस्ट टिप्पणी