'%s लाई प्रतिक्रियाहरू','block titleComment Date'=>'टिप्पणी मिति','block titleComment Content'=>'टिप्पणी सामग्री','Default Avatar'=>'पूर्वनिर्धारित अवतार','There is already a ping from that URL for this post.'=>'यस पोस्टको लागि त्यो युआरएलबाट पहिले नै पिङ आएको छ।','The password cannot be a space or all spaces.'=>'पासवर्ड स्पेस वा सबै स्पेस हुन सक्दैन।','Need more help? <a href="%1$s">Read the support article on %2$s</a>.'=>'थप सहयोग चाहिन्छ? <a href="%1$s">%2$s मा सहायता सम्बन्धी लेख पढ्नुहोस्</a>।','The database server could be connected to (which means your username and password is okay) but the %s database could not be selected.'=>'डेटाबेस सर्भरमा जडान हुन सक्छ (जसको मतलब तपाईंको प्रयोगकर्ता नाम र पासवर्ड ठीक छ) तर %s डेटाबेस चयन गर्न सकिएन।','Cannot select database'=>'डाटाबेस चयन गर्न सकिएन','That file cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'त्यो फाइल फेला पार्न सकिएन। आफ्नो <a href="%s">मिडिया लाइब्रेरी</a> जाँच गर्नुहोस् र हटाइएको छैन भनेर सुनिश्चित गर्नुहोस्।','Sorry, the video at the supplied URL cannot be loaded. Please check that the URL is for a supported video file (%s) or stream (e.g. YouTube and Vimeo).'=>'माफ गर्नुहोस्, प्रदान गरिएको युआरएलमा भिडियो लोड गर्न सकिएन। कृपया युआरएल समर्थित भिडियो फाइल (%s) वा स्ट्रिम (जस्तै युट्युब र भिमियो) को लागि हो भनेर जाँच गर्नुहोस्।','That video cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'त्यो भिडियो फेला पार्न सकिएन। आफ्नो <a href="%s">मिडिया लाइब्रेरी</a> जाँच गर्नुहोस् र यो मेटिएको छैन भनेर सुनिश्चित गर्नुहोस्।','That image cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'त्यो तस्बिर फेला पार्न सकिएन। आफ्नो <a href="%s">मिडिया लाइब्रेरी</a> जाँच गर्नुहोस् र यो मेटिएको छैन भनेर सुनिश्चित गर्नुहोस्।','That audio file cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'त्यो अडियो फाइल फेला पार्न सकिएन। आफ्नो <a href="%s">मिडिया लाइब्रेरी</a> जाँच गर्नुहोस् र यो मेटिएको छैन भनेर सुनिश्चित गर्नुहोस्।','Unable to pass %s if not using multisite.'=>'मल्टिसाइट प्रयोग नगर्दा %s पास गर्न मिल्दैन।','User URL may not be longer than 100 characters.'=>'प्रयोगकर्ता युआरएल १०० वर्णहरू भन्दा लामो हुन सक्दैन।','Each webfont src must be a non-empty string.'=>'प्रत्येक वेबफन्ट एसआरसी एक गैररिक्त स्ट्रिङ हुनुपर्छ।','Webfont font family must be a non-empty string.'=>'वेबफन्टको फन्ट-फ्यामली एक गैररिक्त स्ट्रिङ हुनुपर्छ।','Webfont src must be a non-empty string or an array of strings.'=>'वेबफन्टको एसआरसी एक गैररिक्त स्ट्रिङ वा स्ट्रिङहरूको एरे हुनुपर्छ।','Webfont font weight must be a properly formatted string or integer.'=>'वेबफन्टको फन्ट-वेट सही ढाँचाबद्ध स्ट्रिङ वा पूर्णाङ्क हुनुपर्छ।','Ancestor blocks.'=>'पूर्वज ब्लकहरू।','Limit results to those matching a pattern (slug).'=>'प्याटर्न (स्लग) सँग मिल्ने परिणामहरूमा सीमित गर्नुहोस्।','Determines whether the pattern is visible in inserter.'=>'प्याटर्न इन्सर्टरमा देखिने छ कि छैन भनेर निर्धारण गर्दछ।','The pattern category slugs.'=>'प्याटर्नको वर्गको स्लगहरू।','The pattern detailed description.'=>'प्याटर्नको विस्तृत विवरण।','Block types that the pattern is intended to be used with.'=>'प्याटर्न प्रयोग गर्न अभिप्रेरित ब्लक प्रकार।','The category label, in human readable format.'=>'वर्गको लेबल, मानव पठनीय ढाँचामा।','Sorry, you are not allowed to view the registered block pattern categories.'=>'माफ गर्नुहोस्, तपाईँलाई दर्ता गरिएको ब्लक प्याटर्नहरूको वर्गहरू हेर्न अनुमति छैन।','Sorry, you are not allowed to view the registered block patterns.'=>'माफ गर्नुहोस्, तपाईँलाई दर्ता गरिएका ब्लक प्याटर्नहरू हेर्न अनुमति छैन।','The pattern name.'=>'प्याटर्नको नाम।','The category name.'=>'वर्गको नाम।','The pattern keywords.'=>'प्याटर्न किवर्डहरू।','The pattern viewport width for inserter preview.'=>'इन्सर्टर पूर्वावलोकनको लागि प्याटर्नको भ्युपोर्टको चौडाइ।','Error in deleting the attachment.'=>'एट्याचमेन्ट मेटाउने क्रममा त्रुटि भयो।','unit symbolPB'=>'पिबी','unit symbolYB'=>'वाइबी','unit symbolZB'=>'जेडबी','unit symbolEB'=>'इबी','<strong>Error:</strong> This is not a valid feed template.'=>'<strong>त्रुटि:</strong> यो मान्य फिडको टेम्प्लेट होइन।','The description will be displayed in the menu if the active theme supports it.'=>'विवरण मेनुमा यदि सक्रिय थिमले समर्थन गर्छ भने प्रदर्शित हुनेछ।','A title on that page cannot be found.'=>'त्यो पृष्ठमा शीर्षक फेला पार्न सकिँदैन।','color schemeDark'=>'गाढा','color schemeLight'=>'उज्यालो','<strong>Error:</strong> The themes directory is either empty or does not exist. Please check your installation.'=>'<strong>त्रुटि:</strong> थिम डाइरेक्टरी या त खाली छ वा उपलब्ध छैन। कृपया आफ्नो स्थापना जाँच गर्नुहोस्।','File does not exist?'=>'फाइल अवस्थित छैन?','Adding an RSS feed to this site’s homepage is not supported, as it could lead to a loop that slows down your site. Try using another block, like the <strong>Latest Posts</strong> block, to list posts from the site.'=>'यस साइटको गृहपृष्ठमा RSS फिड थप्न समर्थित छैन, किनकि यसले तपाईंको साइटलाई ढिलो पार्ने लूप निम्त्याउन सक्छ। अर्को ब्लक प्रयोग गर्ने प्रयास गर्नुहोस्, जस्तै <strong>पछिल्लो पोस्टहरू</strong> ब्लक, साइटबाट पोस्टहरूलाई सूचीबद्ध गर्न।','Responses'=>'प्रतिक्रियाहरू','Response'=>'प्रतिक्रिया','(%s author archive, opens in a new tab)'=>'(%s लेखक अभिलेख, नयाँ ट्याबमा खुल्छ)','%s Avatar'=>'%s अवतार','(%s website link, opens in a new tab)'=>'(%s वेबसाइट लिङ्क, नयाँ ट्याबमा खुल्छ)','Older Comments'=>'पुराना टिप्पणीहरू','Newer Comments'=>'नयाँ टिप्पणीहरू','Could not register file "%s" as a block pattern ("Title" field missing)'=>'फाइल "%s" लाई ब्लक प्याटर्नको रूपमा दर्ता गर्न सकिएन ("शीर्षक" फिल्ड हराइरहेको छ)','Could not register file "%1$s" as a block pattern (invalid slug "%2$s")'=>'फाइल "%1$s" लाई ब्लक प्याटर्नको रूपमा दर्ता गर्न सकिएन (अमान्य स्लग "%2$s")','Could not register file "%s" as a block pattern ("Slug" field missing)'=>'फाइल "%s" लाई ब्लक प्याटर्नको रूपमा दर्ता गर्न सकिएन ("स्लग" फिल्ड छैन)','Block pattern categoryFeatured'=>'विशेष','Hurray! Your theme supports site editing with blocks. <a href="%1$s">Tell me more</a>. %2$s'=>'हुर्रे! तपाईंको थिमले ब्लकहरूको साथमा पूर्ण साइट सम्पादनलाई समर्थन गर्दछ। <a href="%1$s">मलाई थप बताउनुहोस्</a>। %2$s','Use Site Editor'=>'&#8216;साइट सम्पादक&#8217; खोल्नुहोस्','Icon'=>'आइकन','Site icon.'=>'साइट आइकन।','block titleTerm Description'=>'टर्म विवरण','block descriptionEdit the different global regions of your site, like the header, footer, sidebar, or create your own.'=>'हेडर, फुटर, साइडबार जस्ता तपाईंको साइटका विभिन्न ग्लोबल क्षेत्रहरू सम्पादन गर्नुहोस् वा आफ्नै सिर्जना गर्नुहोस्।','block descriptionDisplay the description of categories, tags and custom taxonomies when viewing an archive.'=>'आर्काइभ हेर्ने बेला बर्ग, ट्याग तथा कस्टम ट्याकसोनोमीहरुको विवरण देखाउनुहोस्।','block titleTemplate Part'=>'टेम्प्लेट पार्ट','block descriptionDisplays the name of this site. Update the block, and the changes apply everywhere it’s used. This will also appear in the browser title bar and in search results.'=>'यो साइटको नाम देखाउनुहोस् । ब्लक अपडेट गर्नुहोस् अनि यो प्रयोग भएको सबै ठाउँमा परिवर्तनहरू लागू हुन्छन् । यो ब्राउजरको शीर्षक पट्टी र खोज परिणामहरूमा पनि देखा पर्नेछ।','block descriptionCreate structured content in rows and columns to display information.'=>'जानकारी प्रदर्शन गर्न पङ्क्ति र कोलमहरूमा संरचित सामग्री सिर्जना गर्नुहोस्।','block style labelPlain'=>'सादा','block titlePrevious Page'=>'अघिल्लो पृष्ठ','block titleNext Page'=>'अर्को पृष्ठ','block titlePagination'=>'पृष्ठाङ्कन','block titlePage Numbers'=>'पृष्ठ नम्बरहरू','block titlePost Navigation Link'=>'पोस्ट नेभिगेसन लिङ्क','block descriptionDisplay a post\'s comments form.'=>'पोस्टको टिप्पणी गर्ने फारम प्रदर्शन गर्नुहोस्।','block descriptionDisplays the next or previous post link that is adjacent to the current post.'=>'हालको पोस्टको छेउमा रहेको अर्को वा अघिल्लो पोस्ट लिङ्क प्रदर्शन गर्दछ।','block titleNavigation'=>'नेभिगेसन','block titleCustom Link'=>'कस्टम लिङ्क','block titleComments Form'=>'टिप्पणी फाराम','block titlePattern'=>'प्याटर्न','block descriptionAdd a page, link, or another item to your navigation.'=>'तपाईँको नेभिगेसनमा एउटा पेज, लिङ्क अथवा अर्को आइटम थप्नुहोस्।','block descriptionA collection of blocks that allow visitors to get around your site.'=>'ब्लकहरूको एक सङ्कलन जसले आगन्तुकहरूलाई तपाईँको साइटमा घुमफिर गर्न सहयोग गर्छ।','block titleSubmenu'=>'सबमेनु','block descriptionAdd a submenu to your navigation.'=>'आफ्नो नेभिगेसनमा एउटा सबमेनु थप्नुहोस्।','block descriptionShow a block pattern.'=>'ब्लक प्याटर्न देखाउनुहोस्।','block descriptionDisplay content in multiple columns, with blocks added to each column.'=>'प्रत्येक कोलममा थपिएका ब्लकहरू सहित बहु कोलमहरूमा सामग्री प्रदर्शन गर्नुहोस्।','No comments'=>'कुनै टिप्पणीहरू छैनन्','Could not strip invalid text.'=>'अमान्य टेक्स्ट हटाउन सकिएन।','Could not retrieve table charset.'=>'तालिका वर्णसेट पुन: प्राप्त गर्न सकिएन।','WordPress database error: Processing the values for the following fields failed: %s. The supplied values may be too long or contain invalid data.'=>'वर्डप्रेस डेटाबेस त्रुटि: निम्न क्षेत्रहरूको लागि मानहरू प्रशोधन गर्न असफल भयो: %s। आपूर्ति गरिएको मान धेरै लामो हुन सक्छ वा अमान्य डेटा समावेश हुन सक्छ।','WordPress database error: Processing the value for the following field failed: %s. The supplied value may be too long or contains invalid data.'=>'वर्डप्रेस डेटाबेस त्रुटि: निम्न क्षेत्रको लागि मान प्रशोधन असफल भयो: %s। आपूर्ति गरिएको मान धेरै लामो हुन सक्छ वा अवैध डेटा समावेश हुन सक्छ।','WordPress database error: Could not perform query because it contains invalid data.'=>'वर्डप्रेस डाटाबेस त्रुटि: क्वेरी गर्न सकिएन किनभने यसले अमान्य डाटा समावेश गर्छ।','"%1$s" style should not be enqueued together with the new widgets editor (%2$s or %3$s).'=>'"%1$s" स्टाईल नयाँ विजेट सम्पादक (%2$s वा %3$s) सँग पङ्क्तिबद्ध हुनु हुँदैन।','"%1$s" script should not be enqueued together with the new widgets editor (%2$s or %3$s).'=>'"%1$s" स्क्रिप्ट नयाँ विजेट सम्पादक (%2$s वा %3$s) सँग पङ्क्तिबद्ध हुनु हुँदैन।','The description is not prominent by default; however, some themes may show it.'=>'विवरण पूर्वनिर्धारित रूपमा प्रमुख हुँदैन; यद्यपि, केही थिमहरूले यसलाई देखाउन सक्छन्।','Assign a parent term to create a hierarchy. The term Jazz, for example, would be the parent of Bebop and Big Band.'=>'पदानुक्रम सिर्जना गर्न प्यारेन्ट टर्म तोक्नुहोस्। उदाहरणका लागि, &#8216;मनोरञ्जन&#8217; भन्ने वर्ग &#8216;चलचित्र&#8217; र &#8216;टेलिभिजन&#8217; का प्यारेन्ट वर्ग हुन सक्छन्।','The name is how it appears on your site.'=>'नाम त्यो हो जुन तपाईँको साइटमा देखिन्छ।','The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.'=>'&#8220;स्लग&#8221; नामको युआरएल मैत्री संस्करण हो। यसमा सामान्यतया सानो वर्णका अक्षरहरू हुन्छन् अनि अक्षर, अङ्क र योजक मात्र हुनसक्छन्।','Template Part Areas'=>'टेम्प्लेट भागको क्षेत्रहरू','Template Part Area'=>'टेम्प्लेट भागको क्षेत्र','The server cannot process the image. This can happen if the server is busy or does not have enough resources to complete the task. Uploading a smaller image may help. Suggested maximum size is 2560 pixels.'=>'सर्भरले तस्बिर प्रशोधन गर्न सक्दैन। यदि सर्भर व्यस्त छ वा कार्य पूरा गर्न पर्याप्त स्रोतहरू छैनन् भने यो हुन सक्छ। सानो छवि अपलोड गर्नाले मद्दत हुन सक्छ। सुझाइएको अधिकतम साइज २५६० पिक्सेल हो।','Limit result set to users who have published posts.'=>'पोस्टहरू प्रकाशित गर्ने प्रयोगकर्ताहरूको लागि सीमित परिणाम सेट।','Limit result set to users matching at least one specific capability provided. Accepts csv list or single capability.'=>'उपलब्ध गराइएको कम्तिमा एउटा विशिष्ट क्षमतासँग मेल खाने प्रयोगकर्ताहरूमा सीमित परिणाम सेट। सिएसभी सूची वा एकल क्षमता स्वीकार गर्दछ।','Invalid URL'=>'अबैध युआरएल','Unable to retrieve body from response at this URL.'=>'यस युआरएलमा प्रतिक्रियाबाट शरीर पुन: प्राप्त गर्न असमर्थ।','The URL to process.'=>'प्रशोधन गर्नको लागि युआरएल।','The content of the %s element from the URL.'=>'युआरएलबाट %s एलिमेन्टको सामग्री।','The favicon image link of the %s element from the URL.'=>'युआरएलबाट %s एलिमेन्टको फेभिकन छवि लिङ्क।','The contents of the %s element from the URL.'=>'युआरएलबाट %s एलिमेन्टको सामग्रीहरु।','The Open Graph image link of the %1$s or %2$s element from the URL.'=>'युआरएलबाट %1$s वा %2$s एलिमेन्टको खुला ग्राफ तस्बिर लिङ्क।','Sorry, you are not allowed to process remote URLs.'=>'माफ गर्नुहोस्, तपाईँलाई रिमोट युआरएललाई प्रशोधन गर्न अनुमति छैन।','URL not found. Response returned a non-200 status code for this URL.'=>'युआरएल भेटिएन। प्रतिक्रियाले यो युआरएलको लागि गैर-२०० स्थिति कोड फिर्ता गर्‍यो।','Sorry, you are not allowed to filter users by capability.'=>'माफ गर्नुहोस्, तपाईँलाई क्षमता अनुसार प्रयोगकर्ताहरूलाई फिल्टर गर्न अनुमति छैन।','Whether a template is a custom template.'=>'टेम्प्लेट आफू अनुकूल टेम्प्लेट हो कि होइन।','Where the template part is intended for use (header, footer, etc.)'=>'जहाँ टेम्प्लेट भाग प्रयोगको लागि हो (हेडर, फुटर, आदि)','Source of a customized template'=>'एक अनुकूलित टेम्प्लेटको स्रोत','Type of template.'=>'टेम्प्लेटको प्रकार।','Limit to the specified template part area.'=>'निर्दिष्ट टेम्प्लेटको भाग क्षेत्रमा सीमित गर्नुहोस्।','HTML title for the template, transformed for display.'=>'टेम्प्लेटको लागि एचटिएमएल शीर्षक, प्रदर्शन गर्न रुपान्तरण गरिएको ।','Post type to get the templates for.'=>'टेम्प्लेटहरू प्राप्त गर्न पोस्टको प्रकार।','Whether to make the post type available for selection in navigation menus.'=>'नेभिगेसन मेनुहरुमा छनोटको लागि पोस्ट प्रकार उपलब्ध छ कि छैन।','Version of the content block format used by the template.'=>'टेम्प्लेटले प्रयोग गर्ने सामग्री ब्लक ढाँचाको संस्करण।','Title for the template, as it exists in the database.'=>'डाटाबेसमा भए अनुरूपको टेम्प्लेटको शीर्षक।','Content for the template, as it exists in the database.'=>'डाटाबेसमा भए अनुरूपको टेम्प्लेटको सामग्री।','The ID for the author of the template.'=>'टेम्प्लेटको लेखकको लागि आईडी।','REST namespace route for the taxonomy.'=>'ट्याक्सोनोमीको लागि रेस्ट नेमस्पेस रुट।','The menu cannot be deleted.'=>'मेनु मेटाउन सकिएन।','Menus do not support trashing. Set \'%s\' to delete.'=>'मेनुले रद्दीटोकरीलाई समर्थन गर्दैन। मेटाउनको लागि \'%s\' सेट गर्नुहोस्।','The description of the menu location.'=>'मेनु स्थानको विवरण।','The ID of the assigned menu.'=>'तोकिएको मेनुको आईडी ।','The name of the menu location.'=>'मेनु स्थानको नाम।','Invalid menu location.'=>'अवैध मेनु स्थान।','The locations assigned to the menu.'=>'मेनुमा तोकिएका स्थानहरू।','The visibility settings for the post type.'=>'पोस्ट प्रकारको लागि दृश्यता सेटिङहरू।','The terms assigned to the object in the %s taxonomy.'=>'%s वर्गीकरणमा अब्जेक्टलाई तोकिएका टर्महरू।','Whether to automatically add top level pages to this menu.'=>'यस मेनुमा शीर्ष स्तरका पृष्ठहरू स्वत: थप्ने कि नथप्ने।','Sorry, you are not allowed to view menus.'=>'माफ गर्नुहोस्, तपाईँलाई मेनुहरू हेर्न अनुमति छैन।','Sorry, you are not allowed to view menu locations.'=>'माफ गर्नुहोस्, तपाईँलाई मेनु स्थानहरू हेर्न अनुमति छैन।','REST route\'s namespace for the post type.'=>'पोस्ट प्रकारको लागि रेस्ट रुटको नेमस्पेस।','Whether to generate a default UI for managing this post type.'=>'यो पोस्ट प्रकार व्यवस्थापन गर्नको लागि पूर्वनिर्धारित यूआई उत्पन्न गर्ने कि नगर्ने।','An alphanumeric identifier for the menu location.'=>'मेनु स्थानको लागि एक अल्फान्युमेरिक परिचायक।','The type of object originally represented, such as "category", "post", or "attachment".'=>'मूल रूपमा प्रतिनिधित्व गरिएको अब्जेक्टको प्रकार, जस्तै "वर्ग", "पोस्ट", वा "एट्याचमेन्ट"।','The XFN relationship expressed in the link of this menu item.'=>'यस मेनु अब्जेक्टको लिङ्कमा व्यक्त गरिएको XFN सम्बन्ध।','Whether the menu item represents an object that no longer exists.'=>'मेनु अब्जेक्तले अब अवस्थित नभएको अब्जेक्ट लाई प्रतिनिधित्व गर्छ कि गर्दैन।','The singular label used to describe this type of menu item.'=>'यस प्रकारको मेनु अब्जेक्टको वर्णन गर्न प्रयोग गरिएको एकवचन लेबल।','The database ID of the original object this menu item represents, for example the ID for posts or the term_id for categories.'=>'यो मेनु अब्जेक्टले प्रतिनिधित्व गर्ने मूल अब्जेक्टको डेटाबेस आईडी, उदाहरणका लागि पोस्टहरूको आईडी वा वर्गहरूको लागि term_id।','The URL to which this menu item points.'=>'यो मेनु अब्जेक्टलाई इङ्गित गर्ने युआरएल।','The target attribute of the link element for this menu item.'=>'यो मेनु आइटमको लागि लिङ्क तत्त्वको लक्ष्य विशेषता।','A named status for the object.'=>'अब्जेक्टको लगि नमाकरण गरिएको स्टाटस ।','The DB ID of the nav_menu_item that is this item\'s menu parent, if any, otherwise 0.'=>'nav_menu_item को DB ID जुन यो आइटमको प्यारेन्ट मेनु हो, यदि कुनै हो भने, अन्यथा ०।','Class names for the link element of this menu item.'=>'यस मेनु आइटमको लिङ्क एलिमेन्टको लागि वर्ग नामहरू।','Text for the title attribute of the link element for this menu item.'=>'यो मेनु आइटमको लिङ्क एलिमेन्टको शीर्षक विशेषताको लागि टेक्स्ट।','The family of objects originally represented, such as "post_type" or "taxonomy".'=>'"post_type" वा "ट्याक्सोनोमी" जस्ता मूल रूपमा प्रतिनिधित्व गरिएका अब्जेक्टहरुको समूह।','The ID for the parent of the object.'=>'अब्जेक्टको प्यारेन्टको लागि आईडी।','The description of this menu item.'=>'यस मेनु आइटमको विवरण।','Get linked object.'=>'लिङ्क गरिएको अब्जेक्ट प्राप्त गर्नुहोस्।','The title is required when using a custom menu item type.'=>'कस्ट्म मेनु आइटम प्रकार प्रयोग गर्दा शीर्षक आवश्यक छ।','Menu items do not support trashing. Set \'%s\' to delete.'=>'मेनु आइटमले रद्दीटोकरीलाई समर्थन गर्दैनन्। मेटाउनको लागि \'%s\' सेट गर्नुहोस्।','Sorry, you are not allowed to access the global styles on this site.'=>'माफ गर्नुहोस्, तपाईलाई यो वेबसाइटमा प्रयोगकर्ता विवरण हेर्ने अनुमति छैन।','Title for the object, as it exists in the database.'=>'डाटाबेसमा भए अनुरूपको अब्जेक्टको शीर्षक।','HTML title for the object, transformed for display.'=>'अब्जेक्टको एचटिएमएल शीर्षक, प्रदर्शनको लागि रूपान्तरित।','The url is required when using a custom menu item type.'=>'कस्टम मेनु आइटम प्रकार प्रयोग गर्दा युआरएल अनिवार्य हुन्छ।','The theme identifier'=>'थिम पहिचानकर्ता','Title for the global styles variation, as it exists in the database.'=>'ग्लोबल स्टाइल भिन्नताको लागि शीर्षक, यो डाटाबेसमा अवस्थित छ।','Global styles.'=>'ग्लोबल स्टाइलहरू।','ID of global styles config.'=>'ग्लोबल स्टाइल कन्फिगरेसनको आइडी ।','No global styles config exist with that id.'=>'त्यो आईडीसँग कुनै पनि ग्लोबल स्टाइल कन्फिगरेसनहरू अवस्थित छैनन्।','Sorry, you are not allowed to export templates and template parts.'=>'माफ गर्नुहोस्, तपाईलाई टेम्प्लेट वा टेम्प्लेटका अंग निर्यात गर्ने अनुमति छैन।','The date when the block was last updated.'=>'ब्लक अन्तिम पटक अपडेट गरिएको मिति।','Public facing and editor style handles.'=>'सार्वजनिक फेसिङ र सम्पादक स्टाइल ह्यान्डलहरू।','Sorry, you are not allowed to view this global style.'=>'माफ गर्नुहोस्, तपाईँलाई यो ग्लोबल स्टाइल हेर्न अनुमति छैन।','Sorry, you are not allowed to edit this global style.'=>'माफ गर्नुहोस्, तपाईँलाई यो ग्लोबल स्टाइल सम्पादन गर्न अनुमति छैन।','Global settings.'=>'ग्लोबल सेटिङहरू।','Title of the global styles variation.'=>'ग्लोबल स्टाइल विविधताको शीर्षक।','Public facing and editor script handles.'=>'सार्वजनिक र सम्पादक स्क्रिप्ट ह्यान्डलहरू।','file type groupAudio'=>'अडियो','Filter Navigation Menu list'=>'फिल्टर नेभिगेसन मेनु सूची','Uploaded to this Navigation Menu'=>'यो नेभिगेसन मेनुमा अपलोड गरियो','Insert into Navigation Menu'=>'नेभिगेसन मेनुमा प्रविस्ट गर्नुहोस्','Navigation Menu archives'=>'नेभिगेसन मेनुका अभिलेखहरू','Add New Navigation Menu'=>'नयाँ नेभिगेसन मेनु थप्नुहोस्','New Navigation Menu'=>'नयाँ नेभिगेसन मेनु','Edit Navigation Menu'=>'नेभिगेसन मेनु सम्पादन गर्नुहोस्','View Navigation Menu'=>'नेभिगेसन मेनु हेर्नुहोस्','No Navigation Menu found in Trash.'=>'रद्दीटोकरीमा कुनै नेभिगेसन मेनु फेला परेन।','Parent Navigation Menu:'=>'प्यारेन्ट नेभिगेसन मेनु:','Search Navigation Menus'=>'नेभिगेसन मेनुहरु खोज्नुहोस्','No Navigation Menu found.'=>'नेभिगेसन मेनु भेटिएन।','Navigation Menus list'=>'नेभिगेसन मेनुहरूको सूची','Navigation Menus list navigation'=>'नेभिगेसन मेनुहरूको