>'<strong>त्रुटि:</strong> अज्ञात युजरनेम। फेरि जाँच गर्नुहोस् वा तपाईँको इमेल ठेगाना प्रयास गर्नुहोस्।','<strong>Error:</strong> Unknown email address. Check again or try your username.'=>'<strong>त्रुटि:</strong> अज्ञात इमेल ठेगाना। फेरि जाँच गर्नुहोस् वा तपाईँको युजरनेम प्रयास गर्नुहोस्।','<strong>Error:</strong> Your password reset link has expired. Please request a new link below.'=>'<strong>त्रुटि:</strong> तपाईँको पासवर्ड रिसेट लिङ्कको म्याद समाप्त भएको छ। कृपया तल एउटा नयाँ लिङ्क अनुरोध गर्नुहोस्।','Block HTML:'=>'ब्लक एचटिएमएल:','navigation link block titleCategory Link'=>'वर्ग लिङ्क','navigation link block descriptionA link to a tag.'=>'ट्यागको लिङ्क।','<strong>Error:</strong> The passwords do not match.'=>'<strong> त्रुटि:</strong> पासवर्डहरू मिलेनन्।','<strong>Error:</strong> User registration is currently not allowed.'=>'<strong>त्रुटि:</strong> प्रयोगकर्ता दर्ताको लागि हाल अनुमति छैन।','<strong>Error:</strong> Your password reset link appears to be invalid. Please request a new link below.'=>'<strong>त्रुटि:</strong> तपाईँको पासवर्ड रिसेट लिङ्क अमान्य देखिन्छ। कृपया नयाँ लिङ्कको लागि तल अनुरोध गर्नुहोस्।','<strong>Error:</strong> The username <strong>%s</strong> is not registered on this site. If you are unsure of your username, try your email address instead.'=>'<strong>त्रुटि:</strong> तपाईँको युजरनेम <strong>%s</strong> यो साइटमा दर्ता छैन। यदि तपाईँ आफ्नो युजरनेम बारे अनिश्चित हुनुहुन्छ भने, तपाईँको इमेल ठेगानाबाट कोसिस गर्नुहोस्।','navigation link block descriptionA link to a category.'=>'वर्गको एक लिङ्क।','A widget containing a block.'=>'एउटा ब्लक समावेश भएको विजेट।','Post ID.'=>'पोस्ट आईडी।','Class name'=>'क्लासको नाम','Invalid widget type.'=>'अमान्य विजेटको प्रकार।','The widget type id.'=>'विजेट प्रकार आईडी।','Title of template.'=>'टेम्प्लेटको शीर्षक।','Description of template.'=>'टेम्पलेटको विवरण।','The id of a template'=>'एउटा टेम्प्लेटको आईडी','Source of template'=>'टेम्प्लेटको स्रोत','The requested widget is invalid.'=>'अनुरोध गरिएको विजेट अमान्य छ।','No sidebar exists with that id.'=>'त्यो आईडीसंग कुनै साइडबार अवस्थित छैन।','No widget was found with that id.'=>'यो आईडीको कुनै विजेट भेटिएन।','The sidebar to return widgets for.'=>'विजेटहरु फिर्ता गर्नको लागि साइडबार।','The provided instance is invalid. Must contain raw OR encoded and hash.'=>'प्रदान गरिएको उदाहरण अमान्य छ। कच्चा वा इन्कोडेड र ह्याश समावेश हुनुपर्छ।','The template has already been deleted.'=>'यो टेम्प्लेट पहिले नै मेटिसकेको छ।','The id of a registered sidebar'=>'दर्ता भएको साइडबारको आईडी','Unique slug identifying the template.'=>'टेम्प्लेटलाइ पहिचान गर्ने अद्वितीय स्लग।','Unique slug identifying the widget type.'=>'विजेट प्रकार पहिचान गर्ने अद्वितीय स्लग।','Unique name identifying the sidebar.'=>'साइडबार पहिचान गर्ने अद्वितीय नाम।','The type of the widget. Corresponds to ID in widget-types endpoint.'=>'विजेटको प्रकार। विजेट प्रकार अन्त बिन्दुमा आईडीको अनुरूप गर्नुहोस् ।','Content of template.'=>'टेम्प्लेटको सामग्री।','ID of template.'=>'टेम्प्लेटको आईडी।','Status of sidebar.'=>'साइडबारको स्थिति।','ID of sidebar.'=>'साइडबारको आईडी।','The provided widget type (id_base) cannot be updated.'=>'प्रदान गरिएको विजेटको प्रकार (id_base) अपडेट गर्न सकिदैन।','Widget type (id_base) is required.'=>'विजेटको प्रकार (id_base) आवश्यक छ।','HTML content to append to the sidebar title when displayed. Default is a closing h2 element.'=>'HTML सामग्री देखिदा साइडबार शीर्षकमा थप्न। एक बन्द h2 पूर्वनिर्धारित एलिमेन्ट हो।','HTML content to append to each widget\'s HTML output when assigned to this sidebar. Default is a closing list item element.'=>'यस साइडबारमा तोकिएको बेला प्रत्येक विजेटको HTML आउटपुटमा थप्नको लागि HTML सामग्री। बन्द सूची आइटम पूर्वनिर्धारित एलिमेन्ट हो।','HTML content to prepend to each widget\'s HTML output when assigned to this sidebar. Default is an opening list item element.'=>'यस साइडबारमा तोकिएको बेला प्रत्येक विजेटको HTML आउटपुटमा प्रीपेन्ड गर्न HTML सामग्री। एक ओपन्निंग सूची आइटम पूर्वनिर्धारित एलिमेन्ट हो।','Limit to the specified post id.'=>'निर्दिष्ट पोस्ट आईडीमा सीमित गर्नुहोस्।','Cannot preview a widget that does not extend WP_Widget.'=>'WP_Widget लाई विस्तार गर्न नसक्ने विजेटको पूर्वावलोकन गर्न सकिदैन।','Instance settings of the widget, if supported.'=>'विजेटको इन्स्ट्यान्स सेटिङ, यदि समर्थित छ भने।','Theme file exists.'=>'थिम फाइल अवस्थित छ।','Theme identifier for the template.'=>'टेम्प्लेटको लागि थिम परिचायक।','Human-readable name identifying the widget type.'=>'विजेटको प्रकार पहिचान हुने मानव पठनीय नाम।','Serialized widget form data to encode into instance settings.'=>'इन्स्ट्यान्स सेटिङहरूमा सङ्केतन गर्नको लागि क्रमबद्ध विजेट फाराम डाटा।','Unique identifier for the widget.'=>'विजेटको लागि अद्वितीय परिचायक।','Current instance settings of the widget.'=>'विजेटको वर्तमान इन्स्ट्यान्स सेटिङहरू।','Base64 encoded representation of the instance settings.'=>'Base64 इन्स्ट्यास सेटिङहरूको सङ्केतित प्रतिनिधित्व।','Sorry, you are not allowed to manage widgets on this site.'=>'माफ गर्नुहोस्, तपाईँलाई यस साइटमा विजेटहरूको व्यवस्थापन गर्नको लागि अनुमति छैन।','Cryptographic hash of the instance settings.'=>'इन्स्ट्यान्स सेटिङहरूको क्रिप्टोग्राफिक ह्याश।','Nested widgets.'=>'नेस्ट गरिएका विजेटहरू।','Templates based on theme files can\'t be removed.'=>'टेम्प्लेटमा आधारित थिम फाइलहरू हटाउन सकिँदैन।','Status of template.'=>'टेम्प्लेटको स्टाटस।','Description of sidebar.'=>'साइडबारको विवरण।','Description of the widget.'=>'विजेटको विवरण।','No templates exist with that id.'=>'यो आईडी भएको कुनै पनि टेम्प्लेटहरू अवस्थित छैन।','Sort collection by user attribute.'=>'प्रयोगकर्ताको विशेषता अनुसार संग्रह क्रमबद्ध गर्ने।','Sorry, you are not allowed to access the templates on this site.'=>'माफ गर्नुहोस्, तपाईँलाई यो साइटमा टेम्प्लेटहरूको पहुँचमा अनुमति छैन।','HTML representation of the widget.'=>'विजेटको एचटिएमएल प्रतिनिधित्व।','HTML representation of the widget admin form.'=>'विजेट प्रशासन फारामको एचटिएमएल प्रतिनिधित्व।','Extra CSS class to assign to the sidebar in the Widgets interface.'=>'विजेट इन्टरफेसको साइडबारम