ry, you are not allowed to browse the local block pattern directory.'=>'माफ गर्नुहोस्, तपाईँलाई स्थानीय ब्लक प्याटर्न डाइरेक्टरी ब्राउज गर्न अनुमति छैन।','The pattern ID.'=>'प्याटर्नको आईडी।','The pattern content.'=>'प्याटर्नको सामग्री।','The pattern\'s category slugs.'=>'प्याटर्नको वर्गका स्लगहरू।','A description of the pattern.'=>'प्याटर्नको विवरण।','The preferred width of the viewport when previewing a pattern, in pixels.'=>'प्याटर्न पूर्वावलोकन गर्न रुचाइएको भ्यूपोर्टको चौडाइ, पिक्सेलमा।','URL to the comment.'=>'टिप्पणीको लागि युआरएल।','Block variations.'=>'ब्लक विविधताहरु।','A detailed variation description.'=>'एक विस्तृत विविधता विवरण।','A human-readable variation title.'=>'एक मानव पठनीय विविधता शीर्षक।','The unique and machine-readable name.'=>'अद्वितीय र मेसिन पठनीय नाम।','The ID for the autosave.'=>'स्वत: बचतको लागि आईडी।','Indicates whether the current variation is the default one.'=>'वर्तमान विविधता पूर्वनिर्धारित हो वा होइन भन्ने सङ्केत गर्छ।','The list of scopes where the variation is applicable. When not provided, it assumes all available scopes.'=>'क्षेत्रहरूको सूची जहाँ विविधता लागू हुन्छ। कुनै पनि सूची प्रदान नगरिएको अवस्थामा सबै उपलब्ध स्कोप पर्न जान्छ।','The initial values for attributes.'=>'विशेषताहरूको लागि प्रारम्भिक मानहरू','Unique identifier for the comment.'=>'टिप्पणीको लागि अद्वितीय परिचायक।','Edit Template'=>'टेम्प्लेट सम्पादन गर्नुहोस्','New Template'=>'नयाँ टेम्प्लेट','Cookie check failed'=>'कुकी जाँच असफल भयो','Templates list'=>'टेम्पलेटहरुको सूची','Search Templates'=>'टेम्पलेटहरु खोजनुहोस','Filter templates list'=>'टेम्प्लेटहरूको सूची फिल्टर गर्नुहोस्','navigation link block descriptionA link to a post.'=>'एउटा पोस्टको लिङ्क।','navigation link block descriptionA link to a page.'=>'एउटा पृष्ठको लिङ्क।','navigation link block titlePage Link'=>'पृष्ठको लिङ्क','navigation link block titlePost Link'=>'पोस्टको लिङ्क','Unique identifier for the attachment.'=>'संलग्नको लागि अद्वितीय परिचायक।','No templates found in Trash.'=>'रद्दीटोकरीमा क