umentation/article/faq-troubleshooting/','Learn more about troubleshooting WordPress.'=>'वर्डप्रेस समस्या निवारणको बारेमा थप जान्नुहोस्।','The confirmation key has expired for this personal data request.'=>'यस व्यक्तिगत डाटा अनुरोधको लागि पुष्टीकरण कीको म्याद समाप्त भएको छ।','The confirmation key is invalid for this personal data request.'=>'यो व्यक्तिगत डाटा अनुरोधको लागि पुष्टीकरण की अमान्य छ।','The confirmation key is missing from this personal data request.'=>'यो व्यक्तिगत डाटा अनुरोधमा पुष्टीकरण की छुटेको छ।','Invalid request status.'=>'अमान्य अनुरोधको स्थिति।','It looks like the response did not come from this site.'=>'यस्तो देखिन्छ कि प्रतिक्रिया यस साइटबाट आएन।','%1$s is not one of %2$l.'=>'%1$s चाहि  %2$l मध्ये एक होइन।','Each application name should be unique.'=>'प्रत्येक एप्लिकेसनको नाम अद्वितीय हुनुपर्छ।','%1$s is not %2$s.'=>'%1$s %2$s होइन।','A plugin prevented the hook from being cleared.'=>'एउटा प्लगिनले हुक खाली गर्न बाट रोकेको छ।','Event schedule does not exist.'=>'कार्यक्रम तालिका अवस्थित छैन।','A duplicate event already exists.'=>'एक हुबहु कार्यक्रम पहिले नै अवस्थित छ।','Event timestamp must be a valid Unix timestamp.'=>'घटना टाइमस्ट्याम्प एक मान्य यूनिक्स टाइमस्ट्याम्पमा हुनुपर्छ।','As a percentage of the image, the width to crop the image to. DEPRECATED: Use `modifiers` instead.'=>'तस्बिरको प्रतिशतको रूपमा, तस्बिर काँटछाँट गर्नको लागि चौडाइ। बहिष्कृत: यसको सट्टा `परिमार्जक` प्रयोग गर्नुहोस्।','As a percentage of the image, the y position to start the crop from. DEPRECATED: Use `modifiers` instead.'=>'तस्बिरको प्रतिशतको रूपमा, काँटछाँट सुरु गर्न yको स्थिति। बहिष्कृत: यसको सट्टा `परिमार्जक` प्रयोग गर्नुहोस्।','As a percentage of the image, the height to crop the image to. DEPRECATED: Use `modifiers` instead.'=>'तस्बिरको प्रतिशतको रूपमा, तस्बिर काँटछाँट गरिएपछि रहने उचाइ। बहिष्कृत: यसको सट्टा `modifiers` को उपयोग गर्नुहोस्।','A plugin prevented the event from being scheduled.'=>'एउटा प्लगिनले कार्यक्रम अनुसूचित हुनबाट रोकेको छ।','A plugin prevented the event from being rescheduled.'=>'एउटा प्लागिनले कार्यक्रम पुन: अनुसूचित हुनबाट रोकेको छ।','A plugin prevented the event from being unscheduled.'=>'एउटा प्लगिनले कार्यक्रम अनुसूचित रद्द गर्न रोकेको छ।','The cron event list could not be saved.'=>'क्रोन कार्यक्रम सूची बचत गर्न सकिएन।','A plugin disallowed this event.'=>'एक प्लगिनले यो कार्यक्रम अस्वीकृत गर्‍यो।','As a percentage of the image, the x position to start the crop from. DEPRECATED: Use `modifiers` instead.'=>'तस्बिरको प्रतिशतको रूपमा, काँटछाँट सुरु गर्न xको स्थिति। बहिष्कृत: यसको सट्टा `परिमार्जक` प्रयोग गर्नुहोस्।','The amount to rotate the image clockwise in degrees. DEPRECATED: Use `modifiers` instead.'=>'तस्बिरलाई घडीको दिशामा डिग्रीमा घुमाउने राशि। बहिष्कृत: यसको सट्टा `परिमार्जक` प्रयोग गर्नुहोस्।','Vertical position from the top to begin the crop as a percentage of the image height.'=>'तस्बिरको उचाइको प्रतिशतको रूपमा काँटछाँट सुरु गर्न माथिबाट ठाडो स्थिति।','Width of the crop as a percentage of the image width.'=>'तस्बिरको चौडाइको प्रतिशतको रूपमा, काँटछाँटको चौडाइ।','Height of the crop as a percentage of the image height.'=>'तस्बिरको उचाइको प्रतिशतको रूपमा, काँटछाँटको उचाइ।','Rotation type.'=>'घुमाउने प्रकार।','Image edit.'=>'तस्बिर सम्पादन।','Cannot introspect application password.'=>'एप्लिकेसन पासवर्डलाई आत्मनिरीक्षण गर्न सक्दैन।','Horizontal position from the left to begin the crop as a percentage of the image width.'=>'तस्बिरको चौडाइको प्रतिशतको रूपमा काँटछाँट सुरु गर्न बायाँबाट तेर्सो स्थान।','Crop type.'=>'क्रप प्रकार।','Rotation'=>'घुमाइ','Angle to rotate clockwise in degrees.'=>'घडीको दिशामा घुमाउनको लागि कोण, डिग्रीमा।','Sorry, you are not allowed to edit this application password.'=>'माफ गर्नुहोस्, तपाईँलाई यो एप्लिकेसन पासवर्ड सम्पादन गर्न अनुमति छैन।','Sorry, you are not allowed to delete this application password.'=>'माफ गर्नुहोस्, तपाईँलाई यो एप्लिकेसन पासवर्ड मेटाउन अनुमति छैन।','Sorry, you are not allowed to delete application passwords for this user.'=>'माफ गर्नुहोस्, तपाईँलाई य