n readable format.'=>'ब्लकको पछिल्लो अपडेटको मिति, मानव पठनीय ढाँचामा।','This username is invalid because it uses illegal characters. Please enter a valid username.'=>'यो युजरनेम अमान्य छ किनकि येशले अवैध वर्णहरु को उपयोग गर्दछ। कृपया मान्य युजरनेम प्रविष्ट गर्नुहोस्।','The block title, in human readable format.'=>'ब्लकको शीर्षक, मानव पठनीय ढाँचामा।','The plugin\'s text domain.'=>'प्लगिनको टेक्स्ट डोमेन।','The block slug.'=>'ब्लकको स्लग।','The WordPress.org username of the block author.'=>'ब्लक लेखकको WordPress.org युजरनेम।','The star rating of the block.'=>'ब्लकको स्टार रेटिङ्ग।','A short description of the block, in human readable format.'=>'ब्लकको छोटो विवरण, मानव पठनीय ढाँचामा।','The number of ratings.'=>'रेटिङ्गको सङ्ख्या।','The number sites that have activated this block.'=>'यो ब्लक सक्रिय भएको साइटहरूको सङ्ख्या।','The number of blocks published by the same author.'=>'एकै लेखक द्वारा प्रकाशित ब्लकहरूको सङ्ख्या।','The average rating of blocks published by the same author.'=>'एकै लेखक द्वारा प्रकाशित ब्लकहरूको औसत रेटिङ्ग।','Sorry, you are not allowed to browse the block directory.'=>'माफ गर्नुहोस्, तपाईँलाई ब्लक डाइरेक्टरी ब्राउज गर्न अनुमति छैन।','Limits results to plugins with the given status.'=>'दिइएको स्टाटस भएको प्लगिनहरूमा नतिजा सीमित गर्दछ।','The block name, in namespace/block-name format.'=>'ब्लकको नाम, नेमस्पेस/ब्लक-नाम (namespace/block-name) ढाँचामा।','Cannot delete an active plugin. Please deactivate it first.'=>'एउटा सक्रिय प्लगिन मेटाउन सकिँदैन। कृपया पहिले यसलाई निष्क्रिय गर्नुहोस्।','WordPress.org plugin directory slug.'=>'WordPress.org प्लगिन डाइरेक्टरी स्लग।','Network only plugin must be network activated.'=>'नेटवर्क मात्र प्लगिनमा नेटवर्क सक्रिय हुनुपर्छ।','Unable to determine what plugin was installed.'=>'के प्लगिन स्थापित थियो निर्धारण गर्न असमर्थ भयो।','The plugin description.'=>'प्लगिन विवरण।','The plugin name.'=>'प्लगिनको नाम।','The plugin file.'=>'प्लगिनको फाइल।','Minimum required version of WordPress.'=>'वर्डप्रेसको न्यूनतम आवश्यक संस्