arent innerBlocks schema.'=>'भित्री ब्लकको आफ्नै भित्री ब्लकहरूको सूची। यो प्यारेन्ट innerBlocks स्कीमालाई अनुसरण गर्ने पुनरावर्ती परिभाषा हो। ','Public text domain.'=>'सार्वजनिक टेक्स्ट डोमेन।','Block example.'=>'ब्लक उदाहरण।','The human-readable label for the style.'=>'स्टाइलको लागि मानव-पठनीय लेबल।','Inline CSS code that registers the CSS class required for the style.'=>'स्टाइलको लागि आवश्यक इन्लाईन CSS कोड जस्ले CSS क्लास रेजिस्टर गर्छ।','Unique name identifying the style.'=>'स्टाइल पहिचान गर्ने अद्वितीय नाम।','Contains the handle that defines the block style.'=>'ब्लक स्टाइल परिभाषित गर्ने ह्यान्डल समावेश गर्दछ।','Block keywords.'=>'ब्लक किवर्डहरू।','The theme\'s stylesheet. This uniquely identifies the theme.'=>'थिमको स्टाइलसिट। यसले थिमलाई विशिष्ट रूपमा पहिचान गराउँछ।','Parent blocks.'=>'प्यारेन्ट ब्लकहरू।','The name of the inner block.'=>'भित्री ब्लकको नाम।','The attributes used in the example.'=>'उदाहरणमा प्रयोग गरिएका विशेषताहरू।','The attributes of the inner block.'=>'भित्री ब्लकको विशेषताहरू।','Invalid block type.'=>'अमान्य ब्लक प्रकार ।','Title of block type.'=>'ब्लक प्रकारको शीर्षक।','Unique name identifying the block type.'=>'ब्लक प्रकार पहिचान गर्ने अद्वितीय स्लग।','Description of block type.'=>'ब्लकको विवरण।','Icon of block type.'=>'ब्लक प्रकारको आइकन।','Context provided by blocks of this type.'=>'यस प्रकारका ब्लकहरूद्वारा प्रदान गरिएको सन्दर्भ।','Is the block dynamically rendered.'=>'ब्लक गतिशील रूपमा रेन्डर गरिएको छ।','Context values inherited by blocks of this type.'=>'यस प्रकारका ब्लकहरूद्वारा इनहेरिट गरिएका सन्दर्भ मानहरू।','When registering a default meta value the data must match the type provided.'=>'पूर्वनिर्धारित मेटा मान दर्ता गर्दा डाटा प्रदान गरिएको प्रकारसँग मेल खानुपर्छ।','Public facing script handles.'=>'सार्वजनिक स्क्रिप्ट ह्यान्डल।','Block name.'=>'ब्लकको नाम।','Editor style handles.'=>'एडिटर स्टाइल ह्यान्डल।','Block supports.'=>'ब्लकको समर्थनहरू।','Block attributes.'=>'ब्लकको विशेषताहरू।','Editor script handles.'=>'सम्पादक स्क्रिप्ट ह्यान्डलहरू।','Block style variations.'=>'ब्लक स्टाइलका विविधताहरू।','Sorry, you are not allowed to manage block types.'=>'माफ गर्नुहोस्, तपाईँलाई ब्लक प्रकारहरू व्यवस्थापन गर्न अनुमति छैन।','Block category.'=>'ब्लक वर्ग।','RSS Feed'=>'आरएसएस फिड','The post types that support thumbnails or true if all post types are supported.'=>'थम्बनेलहरू समर्थन गर्ने पोस्टका प्रकारहरू वा सबै पोस्टका प्रकारहरू समर्थित भएमा सत्य छ।','When registering an "array" feature, the feature\'s schema must include the "items" keyword.'=>'"एरे" फिचर दर्ता गर्दा, फिचरको योजनामा ​​"आइटमहरु" कि शब्द समावेश हुनुपर्छ।','When registering an "object" feature, the feature\'s schema must include the "properties" keyword.'=>'"अब्जेक्ट" फिचर दर्ता गर्दा, फिचरको योजनामा ​​"गुण" कि शब्द समावेश हुनुपर्छ।','When registering a "variadic" theme feature, the "type" must be an "array".'=>'"variadic" थिम फिचर दर्ता गर्दा, "प्रकार" एक "एरे" हुनुपर्छ।','theme<strong>Error:</strong> Current WordPress version does not meet minimum requirements for %s.'=>'<strong>त्रुटि:</strong> हालको वर्डप्रेस संस्करणले %s को लागि न्यूनतम आवश्यकताहरू पूरा गर्दैन।','When registering an "array" or "object" feature to show in the REST API, the feature\'s schema must also be defined.'=>'REST API मा देखाउनको लागि "एरे" वा "अब्जेक्ट" फिचर दर्ता गर्दा, फिचरको स्कीमा पनि परिभाषित हुनुपर्छ।','The feature "type" is not valid JSON Schema type.'=>'"type" विशेषता मान्य जेसन स्किमा प्रकार होइन।','This image cannot be displayed in a web browser. For best results convert it to JPEG before uploading.'=>'यो तस्बिर वेब ब्राउजरमा प्रदर्शन गर्न सकिँदैन। उत्कृष्ट नतिजाहरूको लागि अपलोड गर्नु अघि यसलाई JPEG मा रूपान्तरण गर्नुहोस्।','theme<strong>Error:</strong> Current PHP version does not meet minimum requirements for %s.'=>'<strong>त्रुटि:</strong> वर्तमान पिएचपी संस्करणले %s को लागि न्यूनतम आवश्यकताहरूलाई पूरा गर्दैन।','theme<strong>Error:</strong> Current WordPress and PHP versions do not meet minimum requirements for %s.'=>'<strong>त्रुटि:</strong> वर्तमान वर्डप्रेस र पिएचपी संस्करणहरूले %s को न्यूनतम आवश्यकताहरू लाई पूरा गर्दैनन्।','Last Modified'=>'पछिल्लो परिमार्जित','https://www.sitemaps.org/'=>'https://www.sitemaps.org/','Priority'=>'प्राथमिकता','Check your email'=>'ईमेल जाँच गर्नुहोस्','Change Frequency'=>'आवृत्ति परिवर्तन गर्नुहोस्','Fields other than %s are not currently supported for sitemaps.'=>'%s बाहेक अन्य क्षेत्रहरू हाल साइटम्यापहरूको लागि समर्थित छैनन्।','Fields other than %s are not currently supported for the sitemap index.'=>'%s बाहेक अन्य क्षेत्रहरू हाल साइटम्याप अनुक्रमणिकाको लागि समर्थित छैनन्।','Registration complete. Please check your email, then visit the <a href="%s">login page</a>.'=>'दर्ता पूरा भयो। कृपया आफ्नो इमेल जाँच गर्नुहोस्, त्यसपछि <a href="%s">लगइन पृष्ठ</a> मा जानुहोस्।','Edit Profile'=>'प्रोफाइल सम्पादन गर्नुहोस्','XML Sitemap'=>'एक्सएमएल साइटम्याप','Learn more about XML sitemaps.'=>'एक्सएमएल साइटम्यापको बारेमा थप जान्नुहोस्।','Number of URLs in this XML Sitemap: %s.'=>'एक्सएमएल साइटम्यापमा भएका युआरएलहरूको सङ्ख्या: %s।','Could not generate XML sitemap due to missing %s extension'=>'%s एक्सटेन्सन नभएको कारण एक्सएमएल साइटम्याप उत्पन्न गर्न सकिएन','Check your email for the confirmation link, then visit the <a href="%s">login page</a>.'=>'पुष्टीकरण लिङ्कको लागि आफ्नो इमेल जाँच गर्नुहोस्, त्यसपछि <a href="%s">लगइन पृष्ठ</a>मा जानुहोस्।','This XML Sitemap is generated by WordPress to make your content more visible for search engines.'=>'तपाईँको सामग्री सर्च इन्जिनको लागि थप दृश्यात्मक बनाउनको लागि यो एक्सएमएल साइटम्याप वर्डप्रेसद्वारा उत्पन्न गरिएको छ।','Password protected'=>'पासवर्ड संरक्षित','Namespace must not start or end with a slash.'=>'नेमस्पेस स्ल्याशको साथ सुरु वा अन्त्य हुनु हुँदैन।','Sorry, the post could not be deleted.'=>'माफ गर्नुहोस्, पोस्ट मेटाउन सकिएन।','Sorry, the category could not be created.'=>'माफ गर्नुहोस्, वर्ग सिर्जना गर्न सकिएन।','Sorry, the post could not be updated.'=>'माफ गर्नुहोस्, यो पोस्ट अपडेट गर्न सकिएन।','Select poster image'=>'पोस्टर तस्ब