w to describe the purpose of the image%3$s</a>. Leave empty if the image is purely decorative.'=>'<a href="%1$s" %2$s>तस्बिर%3$sको उद्देश्य वर्णन गर्ने बारे जान्नुहोस्</a>। यदि तस्बिर विशुद्ध सजावटी हो भने खाली छोड्नुहोस्।','In this case, WordPress caught an error with your theme, %s.'=>'यो मामिलामा, वर्डप्रेसले तपाईँकाे %s थिममा एउटा त्रुटि भेट्टायो।','In this case, WordPress caught an error with one of your plugins, %s.'=>'यो मामिलामा, वर्डप्रेसले तपाईँकाे %s प्लगिनमा एउटा त्रुटि भेट्टायो।','Howdy!

WordPress has a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'नमस्ते!

वर्डप्रेसमा एक अन्तर्निर्मित सुविधा छ जसले पत्ता लगाउँछ जब प्लगिन वा थिमले तपाईँको साइटमा घातक त्रुटि निम्त्याउँछ, र तपाईँलाई यो स्वचालित इमेलको साथ सूचित गर्दछ।

###CAUSE###
सबभन्दा पहिले तपाईँको साइटमा (###SITEURL###) जानुहोस् र दर्शनीय समस्याहरू जाँच गर्नुहोस्। त्यसपछि, जुन पृष्ठमा त्रुटि भेटिएको थियो (###PAGEURL###), त्यस पृष्ठमा जानुहोस् र दर्शनीय समस्याहरू जाँच गर्नुहोस्।

###SUPPORT###

यदि तपाईँको साइट बिग्रिएको देखियो र तपाईँ ड्यासबोर्ड सामान्य रूपमा पहुँच गर्न सक्नु भएन भने वर्डप्रेसमा अब बिशेष पुनर्प्राप्ति मोड छ। यसले तपाईँलाई सुरक्षित रूपमा तपाईँको ड्यासबोर्डमा लगइन गर्न दिनेछ र तपाईँ थप छानबिन गर्न सक्नुहुनेछ।

###LINK###

तपाईँको साइट सुरक्षित राख्न, यो लिङ्कको अवधि ###EXPIRES### मा समाप्त हुनेछ। यसबारे चिन्ता नलिनुहोला: यदि त्यो त्रुटि फेरि उत्पन्न भएमा तपाईँलाई यो लिङ्कको म्याद समाप्त भएपछि नयाँ लिङ्क इमेलद्वारा पठाइनेछ।

तपाईँको समस्याको समाधान गर्दा निम्न कुराहरू सोध्न सकिने छ:

