###SITEURL###','Search WordPress.org themes'=>'WordPress.org का थिमहरु खोज्नुहोस','Go to theme sources'=>'थिम स्रोतहरूमा फर्कनुहोस्','Install &amp; Preview'=>'स्थापना र पूर्वावलोकन','Only UUID V4 is supported at this time.'=>'हालको लागि UUID V4 मात्रै समर्थित छ।','The Press This plugin is required.'=>'&#8216;प्रेस दिस&#8217; प्लगिन आवश्यक छ।','%s themes'=>'%s थिमहरू','Filter themes (%s)'=>'फिल्टर गरिएका थिमहरू (%s)','Invalid URL.'=>'अबैध युआरएल','Time to add some links! Click &#8220;%s&#8221; to start putting pages, categories, and custom links in your menu. Add as many things as you would like.'=>'अब केही लिङ्कहरू थपौँ! &#8220;%s&#8221; मा क्लिक गरेर पृष्ठहरू, वर्गहरू र कस्टम लिङ्कहरू राख्न सुरु गर्नुहोस्। तपाईँले चाहे जति आइटमहरू थप्न सक्नुहुन्छ।','Choose image'=>'तस्बिर छान्नुहोस्','Choose audio'=>'अडियो छान्नुहोस्','Change audio'=>'अडियो परिवर्तन गर्नुहोस्','Select audio'=>'अडियो चयन गर्नुहोस्','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header height of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'तपाईँको कम्प्युटरबाट तस्बिर अपलोड गर्नको लागि &#8220;नयाँ तस्बिर थप्नुहोस&#8221; मा क्लिक गर्नुहोस्। तस्बिरको हेडर उचाइ %s पिक्सेलमा तपाईँको थिमले सबैभन्दा उत्तम काम गर्छ। एकपटक अपलोड गरे पछि तपाईँले उत्तम फिटको लागी क्रप गर्न सक्नुहुन्छ।','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header width of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'तपाईँको कम्प्युटरबाट तस्बिर फाइल अपलोड गर्नको लागि &#8220;नयाँ तस्बिर थप्नुहोस&#8221; मा क्लिक गर्नुहोस्। तपाईँको थिमले तस्बिरको हेडर चौडाइ %s पिक्सेलमा सबैभन्दा उत्तम काम गर्छ। एकपटक अपलोड गरे पछि तपाईँले उत्तम फिटको लागि क्रप गर्न सक्नुहुन्छ।','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header size of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'तपाईँको कम्प्युटरबाट तस्बिर फाइल अपलोड गर्नको लागि &#8220;नयाँ तस्बिर थप्नुहोस्&#8221; मा क्लिक गर्नुहोस्। तपाईँको थिमले तस्बिरको हेडर साइज %s पिक्सेलमा सबैभन्दा उत्तम काम गर्छ। एकपटक अपलोड गरे पछि तपाईँले उत्तम फिटको लागि क्रप गर्न सक्नुहुन्छ।','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image that matches the size of your video &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'तपाईँको कम्प्युटरबाट तस्बिर फाइल अपलोड गर्नको लागि &#8220;नयाँ तस्बिर थप्नुहोस्&#8221; मा क्लिक गर्नुहोस्। तपाईँको थिमले त्यस तस्बिरसँग राम्रो काम गर्छ जुन भिडियोको साइजसँग मिल्दो जुल्दो हुन्छ। एकपटक अपलोड गरे पछि तपाईँले उत्तम फिटको लागि क्रप गर्न सक्नुहुन्छ।','Hour'=>'घण्टा','Time'=>'समय','Day'=>'दिन','Month'=>'महिना','Date'=>'मिति','New Menu'=>'नयाँ मेनु','%1$s-%2$s'=>'%1$s-%2$s','Meridian'=>'मेरिडियन','Minute'=>'मिनेट','Usage of user levels is deprecated. Use capabilities instead.'=>'प्रयोगकर्ता स्तरको प्रयोग अवमानित गरिएको छ। यसको सट्टा क्षमताहरुको प्रयोग गर्नुहोस् ।','The theme defines itself as its parent theme. Please check the %s header.'=>'यो थिमले आफुलाई आफ्नै मूल थिमको रुपमा परिभाषित गर्छ। कृपया यसको %s हेडर जाँच गर्नुहोस्।','Create New Menu'=>'नयाँ मेनु सिर्जना गर्नुहोस्','Name for the Visual editor tabVisual'=>'दृश्य','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'यदि तपाईँको थिममा विजेट क्षेत्रहरू छन् भने तपाईँ त्यहाँ मेनु पनि थप्न सक्नुहुन्छ। तपाईँ <a href="%s">विजेट प्यानल</a> मा गएर &#8220;नेभिगेसन मेनु विजेट&#8221; थप गरी मेनुलाई साइडबार वा फुटरमा देखाउन सक्नुहुन्छ।','CSS code'=>'सिएसएस कोड','When using a keyboard to navigate:'=>'किबोर्ड प्रयोग गरी नेभिगेट गर्दा:','The edit field automatically highlights code syntax. You can disable this in your <a href="%1$s" %2$s>user profile%3$s</a> to work in plain text mode.'=>'सम्पादन फिल्डले स्वचालित रूपमा कोड सिन्ट्याक्स हाइलाइट गर्दछ । तपाईँ यसलाई <a href="%1$s" %2$s>प्रयोगकर्ता प्रोफाइल%3$s</a>मा गएर सादा पाठमा काम गर्ने बनाउन सक्नुहुन्छ ।','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two Pages. One will become the homepage, and the other will be where your posts are displayed.'=>'तपाईँ छान्न सक्नु हुन्छ कि तपाईँको साइटको गृहपृष्ठमा के प्रदर्शन हुन्छ। यो उल्टो कालक्रम (क्लासिक ब्लग) मा पोस्टहरू, या एक निश्चित/स्थिर पृष्ठ हुन सक्छ। स्थिर गृहपृष्ठ सेट गर्नको लागि तपाईँले सबै भन्दा पहिले दुई पेजहरू सिर्जना गर्न जरुरी छ। एक गृहपृष्ठ हुनेछ भने दोस्रोमा तपाईँका पोस्टहरू प्रदर्शित हुनेछ।','Your homepage displays'=>'तपाईँको गृहपृष्ठ प्रदर्शन गर्दछ','Your theme can display menus in one location.'=>'तपाईँकाे थिमले मेनु एक स्थानमा देखाउन सक्छ।','Your theme can display menus in %s location.'=>'तपाईँको थिमले %s स्थानमा मेनु देखाउन सक्छ।' . "\0" . 'तपाईँको थिमले %s स्थानहरूमा मेनु देखाउन सक्छ।','To move away from this area, press the Esc key followed by the Tab key.'=>'यो क्षेत्रबाट निस्कनको लागि &#8216;इस्केप&#8217; की पछि &#8216;ट्याब&#8217; की थिच्नुहोस्।','Add your own CSS code here to customize the appearance and layout of your site.'=>'तपाईँको साइटको स्वरूप र लेआउट कस्टमाइज गर्न यहाँ आफ्नो सियसयस कोड थप्नुहोस्।','In the editing area, the Tab key enters a tab character.'=>'सम्पादन क्षेत्रमा, &#8216;ट्याब&#8217; कीले ट्याब क्यारेक्टर हाल्छ।','Screen reader users: when in forms mode, you may need to press the Esc key twice.'=>'स्क्रिन रिडर प्रयोगकर्ताहरू: फाराम मोडमा हुँदा, तपाईँले &#8216;इस्केप&#8217; की दुई पटक थिच्नु पर्छ।','If your theme has multiple menus, giving them clear names will help you manage them.'=>'यदि तपाईँको थिममा धेरै मेनुहरू छन् भने तिनीहरूलाई स्पष्ट नाम दिइँदा तपाईँलाई व्यवस्थापन गर्न सहज हुनेछ।','Homepage Settings'=>'गृहपृष्ठ सेटिङहरू','Preview Link'=>'पूर्वावलोकन लिङ्क','WordPress.org themes'=>'WordPress.org का थिमहरु','Unable to trash changes.'=>'परिवर्तनहरू रद्द गर्न असक्षम।','Changes have already been trashed.'=>'परिवर्तनहरू पहिले नै रद्द गरिएको छ।','Changes trashed successfully.'=>'परिवर्तन सफलतापूर्वक रद्द भयो।','There was an authentication problem. Please reload and try again.'=>'यहाँ प्रमाणीकरण समस्या देखिएको छ। कृपया पुन: लोड गरी फेरि प्रयास गर्नुहोस्।','Unable to save due to %s invalid setting.'=>'%s अमान्य सेटिङको कारण वचत गर्न असमर्थ।' . "\0" . '%s अमान्य सेटिङहरूको कारण वचत गर्न असमर्थ।','You must supply a future date to schedule.'=>'अनुसूचित गर्न तपाईँले भविष्यको मिति प्रदान गर्नुपर्छ।','Publish Settings'=>'प्रकाशन सेटिङहरू','No changes saved yet, so there is nothing to trash.'=>'अझै कुनै परिवर्तनहरू बचत भएका छैनन्, त्यसैले रद्दीटोकरीमा हाल्नको लागि केही छैन।','See how changes would look live on your website, and share the preview with people who can\'t access the Customizer.'=>'परिवर्तनहरू तपाईँको वेबसाइटमा कस्तो देखिन्छ प्रत्यक्ष हेर्नुहोस् र पूर्वावलोकनलाई ती व्यक्तिहरूसँग साझा गर्नुहोस् जसलाई &#8216;कस्टमाइजर&#8217; पहुँचमा अनुमति छैन।','Share Preview Link'=>'पूर्वावलोकन लिङ्क साझेदारी','Copied'=>'कपी गरियो','Installed themes'=>'स्थापित थिमहरू','Edit User'=>'प्रयोगकर्ता सम्पादन गर्नुहोस्','View User'=>'प्रयोगकर्ता हेर्नुहोस्','The previous set of changes has already been published. Please try saving your current set of changes again.'=>'परिवर्तनको अघिल्लो सेट पहिल्यै प्रकाशित गरिएको छ। कृपया तपाईंले परिवर्तन गर्नुभएको हालको सेट सुरक्षित गर्ने प्रयास गर्नुहोस्।','This widget may have contained code that may work better in the &#8220;Custom HTML&#8221; widget. If you have not yet, how about trying that widget instead?'=>'यस विजेटमा यस्तो कोड रहेको छ जुन सायद &#8220;कस्टम एचटिएमएल&#8221; विजेटमा राम्रो काम गर्छ। यदि तपाईँले अहिलेसम्म गर्नुभएको छैन भने, त्यो विजेट प्रयोग गर्न प्रयास गर्ने कि?','Hey there, looks like you just pasted HTML into the &#8220;Visual&#8221; tab of the Text widget. You may want to paste your code into the &#8220;Text&#8221; tab instead. Alternately, try out the new &#8220;Custom HTML&#8221; widget!'=>'यस्तो लाग्छ कि तपाईँले टेक्स्ट विजेटको &#8220;देखिने&#8221; ट्याबमा केही एचटीएमएल पेस्ट गर्नुभएको छ। शायद तपाईँ आफ्नो कोडलाई &#8220;टेक्स्ट&#8221; ट्याबमा पेस्ट गर्न चाहनुहुन्थ्यो। वैकल्पिक रूपमा, तपाईँ नयाँ &#8220;कस्टम  एचटीएमएल&#8221; विजेटलाई प्रयोग गर्न सक्नुहुन्छ!','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by scanning the list of available widgets on this screen. Check it out to add some custom code to your site!'=>'के तपाईंले सुन्नुभएको छ कि अब हामी सँग &#8220;कस्टम एचटिएमएल&#8221; विजेट छ? 
