he user.'=>'प्रयोगकर्तालाई तोकिएको अन्य अतिरिक्त क्षमताहरू ।','The email address for the user.'=>'प्रयोगकर्ताको लागि इमेल ठेगाना।','Registration date for the user.'=>'प्रयोगकर्ताको लागि दर्ता मिति।','Password for the user (never included).'=>'प्रयोगकर्ताको लागि पासवर्ड (कहिल्यै समावेश नभएको)।','All capabilities assigned to the user.'=>'प्रयोगकर्तालाई सबै क्षमताहरू तोकियो।','The role %s does not exist.'=>'%s भूमिका अवस्थित छैन।','Sorry, you are not allowed to delete this user.'=>'माफ गर्नुहोस्, तपाईँलाई यो प्रयोगकर्ता मेटाउन अनुमति छैन।','Username is not editable.'=>'युजरनेम सम्पादन गर्न सकिँदैन।','Invalid user ID for reassignment.'=>'पुनर्नियुक्तिका लागि अमान्य प्रयोगकर्ता आईडी।','Sorry, you are not allowed to delete this revision.'=>'माफ गर्नुहोस्, तपाईँलाई यो संशोधन मेटाउन अनुमति छैन।','You are not currently logged in.'=>'तपाईँ हाल लगइन हुनुहुन्न।','Cannot create existing user.'=>'विद्यमान प्रयोगकर्ता सिर्जना गर्न सकिँदैन।','Sorry, you are not allowed to edit roles of this user.'=>'माफ गर्नुहोस्, तपाईँलाई यो प्रयोगकर्ताको भूमिकाहरू सम्पादन गर्न अनुमति छैन।','Type attribution for the term.'=>'टर्मको लागि टाइप विशेषण ।','An alphanumeric identifier for the term unique to its type.'=>'यसको प्रकारमा अद्वितीय भएको टर्मको लागि एक अल्फान्युमेरिक परिचायक।','The ID for the parent of the revision.'=>'संशोधनको प्यारेन्टको लागि आईडी।','Limit result set to terms assigned to a specific post.'=>'एउटा विशिष्ट पोस्टसंग तोकिएको टर्ममा नतिजा सीमित गर्ने।','Whether to hide terms not assigned to any posts.'=>'कुनैपनि पोस्टको लागि नतोकिएका टर्महरू लुकाउने अथवा नलुकाउने।','Limit result set to terms assigned to a specific parent.'=>'विशिष्ट प्यारेन्टहरू तोकिएको टर्महरूमा नतिजा सीमित गर्ने।','Sort collection by term attribute.'=>'सङ्ग्रह टर्म विशेषताद्वारा क्रमबद्ध गर्नुहोस्।','HTML description of the term.'=>'टर्मको एचटिएमएल विवरण।','The template cannot be deleted.'=>'टेम्प्लेट मेटाउन सकिएन।','Number of published posts for the term.'=>'टर्मको लागि प्रकाशित भएका पोस्टहरूको सङ्ख्या।','Unique identifier for the user.'=>'प्रयोगकर्ताको लागि अद्वितीय परिचायक।','Status is forbidden.'=>'स्टाटस निषेध गरिएको छ।','Whether or not the term cloud should be displayed.'=>'टर्म क्लाउड प्रदर्शित गर्ने कि नगर्ने।','The %s property has an invalid stored value, and cannot be updated to null.'=>'%s विशेषताको अमान्य भण्डारण मान छ, र यसलाई रिक्तमा अपडेट गर्न सकिँदैन।','Limit result set to items that are sticky.'=>'स्टिकी आइटमहरूमा नतिजा सीमित गर्ने।','Invalid revision ID.'=>'अमान्य संशोधन आईडी।','Required to be true, as users do not support trashing.'=>'प्रयोगकर्ता रद्दीटोकरीमा सार्न नमिल्ने भएकोले यो true हुन जरुरी छ।','Limit results to taxonomies associated with a specific post type.'=>'एउटा विशिष्ट पोस्ट प्रकारसँग सम्बद्ध ट्याक्सोनोमीहरूमा नतिजा सीमित गर्ने।','Limit result set to items except those with specific terms assigned in the %s taxonomy.'=>'%s ट्याक्सोनोमीमा तोकिएका विशेष सर्तहरू बाहेकका आइटमहरूमा सीमित टर्महरू सेट गर्नुहोस्।','The terms assigned to the post in the %s taxonomy.'=>'%s ट्याक्सोनोमीको पोस्टमा तोकिएको टर्महरु ।','Limit result set to posts assigned to specific authors.'=>'विशिष्ट लेखकहरू तोकिएको पोस्टहरूमा नतिजा सीमित गर्ने।','Limit result set to posts with a specific menu_order value.'=>'विशिष्ट menu_order मान तोकिएका पोस्टहरूमा नतिजा सीमित गर्ने।','Ensure result set excludes posts assigned to specific authors.'=>'नतिजा सेटमा विशिष्ट लेखकहरूलाई तोकिएका पोस्टहरू समावेश नगर्न पक्का हुने।','Limit result set to items with particular parent IDs.'=>'विशिष्ट प्यारेन्ट आईडीहरूमा नतिजा सेट सीमित गर्ने।','Limit result set to all items except those of a particular parent ID.'=>'विशिष्ट प्यारेन्ट आईडीहरू बाहेक अरू सबै आइटमहरूमा नतिजा सेट सीमित गर्ने।','Offset the result set by a specific number of items.'=>'विशिष्ट आइटम सङ्ख्याबाट नतिजा सेटलाई अफसेट गर्ने।','The format for the post.'=>'पोस्टको लागि ढाँचा।','Whether or not the post should be treated as sticky.'=>'पोस्टलाई स्टिकीको रुपमा प्रयोग गर्ने वा नगर्ने।','Whether or not the post can be pinged.'=>'पोस्ट पिङ्ग गर्न मिल्ने वा नमिल्ने।','Whether or not comments are open on the post.'=>'पोस्टमा टिप्पणी खुला हुने वा नहुने।','Whether the excerpt is protected with a password.'=>'पासवर्डद्वारा पाठांश संरक्षित गर्ने वा नगर्ने।','HTML excerpt for the post, transformed for display.'=>'पोस्टको लागि एचटिएमएल पाठांश, प्रदर्शन गर्न रूपान्तरण गरिएको।','A password to protect access to the content and excerpt.'=>'सामग्री र पाठांशको पहुँचको सुरक्षाको लागि पासवर्ड।','The ID of the featured media for the post.'=>'पोस्टको विशेष मिडियाको लागि आईडी।','The theme file to use to display the post.'=>'पोस्ट देखाउन प्रयोग गरिने थिम फाइल।','The title for the object.'=>'अब्जेक्टको लागि शीर्षक।','HTML title for the post, transformed for display.'=>'पोस्टको लागि एचटिएमएल शीर्षक, प्रदर्शन गर्न रुपान्तरण गरिएको ।','The excerpt for the post.'=>'पोस्टको पाठांश।','Excerpt for the post, as it exists in the database.'=>'पोस्टको पाठांश, डाटाबेसमा भए जस्तै।','Title for the post, as it exists in the database.'=>'डाटाबेसमा भए अनुरूपको पोस्टको शीर्षक।','An alphanumeric identifier for the revision unique to its type.'=>'उसको प्रकारमा अद्वितीय भएको संशोधनको लागि एक अल्फान्युमेरिक परिचायक।','Whether the content is protected with a password.'=>'सामग्रीलाई पासवर्डद्वारा संरक्षित गर्ने वा नगर्ने।','A named status for the post.'=>'पोस्टको लागि नामाङ्कित स्टाटस।','The ID for the author of the post.'=>'पोस्टको प्रयोगकर्ताको लागि आईडी।','Invalid featured media ID.'=>'अमान्य विशेष मिडिया आइडि ।','A password protected post can not be set to sticky.'=>'पासवर्ड संरक्षित पोस्टलाई स्टिकी सेट गर्न सकिँदैन।','The date the revision was last modified, in the site\'s timezone.'=>'साइटको टाइमजोनमा संशोधनको पछिल्लो परिमार्जन मिति।','The date the revision was published, in the site\'s timezone.'=>'साइटको टाइमजोनमा, संशोधन प्रकाशित भएको मिति।','Invalid post parent ID.'=>'अमान्य पोस्ट प्यारेन्ट आईडी।','The date the revision was last modified, as GMT.'=>'संशोधनको पछिल्लो परिमार्जित मिति, जीएमटीमा।','The date the revision was published, as GMT.'=>'संशोधन प्रकाशित भएको मिति, जीएमटीमा।','A sticky post can not be password protected.'=>'स्टिकी पोस्टलाई पासवर्ड संरक्षित बनाउन सकिँदैन।','The globally unique identifier for the post.'=>'पोस्टको लागि ग्लोबल अद्वितीय परिचायक।','GUID for the post, transformed for display.'=>'पोस्टको लागि जियुआईडी, प्रदर्शनको लागि रूपान्तरित।','GUID for the revision, as it exists in the database.'=>'संशोधनको लागि जियुआईडी, डाटाबेसमा अवस्थित भए जस्तै रूपमा।','Cannot create existing post.'=>'विद्यमान पोस्ट सिर्जना गर्न सकिँदैन।','A post can not be sticky and have a password.'=>'एक पोस्ट स्टिकी हुन र पासवर्ड हुन सक्दैन।','Sorry, you are not allowed to manage this plugin.'=>'माफ गर्नुहोस्, तपाईँलाई यो प्लगिन व्यवस्थापन गर्न अनुमति छैन।','Sorry, you are not allowed to edit comments.'=>'माफ गर्नुहोस्, तपाईँलाई टिप्पणी सम्पादन गर्न अनुमति छैन।','Sorry, you are not allowed to create new users.'=>'माफ गर्नुहोस्, तपाईँलाई नयाँ प्रयोगकर्ताहरू सिर्जना गर्न अनुमति छैन।','The post has already been deleted.'=>'यो पोस्ट पहिले नै मेटिसकेको छ।','Incorrect post password.'=>'गलत पोस्ट पासवर्ड।','The password for the post if it is password protected.'=>'पोस्टको लागि पासवर्ड यदि पोस्ट पासवर्ड संरक्षित हो भने।','You need to define a search term to order by relevance.'=>'सान्दर्भिकताको आधारमा क्रमबद्ध गर्नको लागि खोज टर्म परिभाषित गरिनुपर्छ।','A human-readable description of the taxonomy.'=>'ट्याक्सोनोमीको एक मानव-पठनीय विवरण।','All capabilities used by the taxonomy.'=>'ट्याक्सोनोमीले प्रयोग गरेका सबै क्षमताहरु।','An alphanumeric identifier for the user.'=>'प्रयोगकर्ताको लागि एक अल्फान्युमेरिक परिचायक।','Whether or not the taxonomy should have children.'=>'ट्याक्सोनोमीमा चिल्ड्रेन हुन पर्ने वा नपर्ने।','Whether posts with this status should be protected.'=>'यो स्टाटसमा भएका पोस्टहरू संरक्षित गरिनु पर्ने वा नपर्ने।','Whether posts with this status should be publicly-queryable.'=>'यो स्टाटसमा भएका पोस्टहरू सार्वजनिक क्वेरी योग्य हुने वा नहुने।','Whether to include posts in the edit listing for their post type.'=>'पोस्टहरूलाई पोस्ट प्रकारको सम्पादन सूचीमा समावेश गर्ने वा नगर्ने।','Whether posts of this status should be shown in the front end of the site.'=>'यो स्टाटसमा भएको पोस्टहरू साइटको फ्रन्टइन्डमा देखिनुपर्ने वा नपर्ने।','Human-readable labels for the taxonomy for various contexts.'=>'विभिन्न प्रसङ्गहरूका लागि ट्याक्सोनोमीको मानव-पठनीय लेबलहरू।','Sorry, you are not allowed to manage post statuses.'=>'माफ गर्नुहोस्, तपाईँलाई पोस्ट स्टाटसहरू व्यवस्थापन गर्न अनुमति छैन।','Current page of the collection.'=>'संग्रहको वर्तमान पृष्ठ।','Whether posts with this status should be private.'=>'यो स्टाटसमा भएका पोस्टहरू निजि हुन पर्ने वा नपर्ने।','Limit results to those matching a string.'=>'मिल्दो स्ट्रिङ्गमा नतिजाहरू सीमित गर्ने।','Maximum number of items to be returned in result set.'=>'नतिजा सेटमा फिर्ता गर्न आइटमहरूको अधिकतम सङ्ख्या।','Scope under which the request is made; determines fields present in response.'=>'दायरा जस अन्तर्गत अनुरोध गरिन्छ; प्रतिक्रियामा हुने फिल्डहरू निर्धारण गर्छ।','Method \'%s\' not implemented. Must be overridden in subclass.'=>'विधि \'%s\' कार्यान्वयन गरिएको छैन। सबक्लासमा ओभरराइड गरिनु पर्छ।','Sort collection by object attribute.'=>'अब्जेक्टको विशेषता अनुसार संग्रह क्रम्बद्ध गर्ने।','Limit result set to comments assigned a specific type. Requires authorization.'=>'विशिष्ट प्रकार टिप्पणीको लागि परिणाम सीमा निर्धारित गर्नुहोस् । प्राधिकरण आवश्यक','Limit result set to comments assigned a specific status. Requires authorization.'=>'विशिष्ट स्थिति टिप्पणीको लागि परिणाम सीमा निर्धारित गर्नुहोस् । प्राधिकरण आवश्यक','Order sort attribute ascending or descending.'=>'क्रम क्रमबद्ध विशेषता बढ्दो वा घट्दो।','Limit result set to comments of specific parent IDs.'=>'विशिष्ट प्यारेन्ट आईडीहरूको टिप्पणीहरूमा नतिजा सीमित गर्ने।','Limit result set to comments assigned to specific post IDs.'=>'विशिष्ट पोस्ट आईडीहरूको तोकिएको टिप्पणीहरूमा नतिजा सीमित गर्ने।','Ensure result set excludes specific parent IDs.'=>'नतिजा सेटमा विशिष्ट प्यारेन्ट आईडीहरू समावेश नगर्न पक्का हुने।','Avatar URL with image size of %d pixels.'=>'तस्बिर आकार %d पिक्सेल भएको अवतार युआरएल।','Limit result set to comments assigned to specific user IDs. Requires authorization.'=>'विशिष्ट प्रयोगकर्ताको टिप्पणीको लागि परिणाम सीमा निर्धारित गर्नुहोस्। प्राधिकरण आवश्यक।','Limit response to posts published before a given ISO8601 compliant date.'=>'दिइएको ISO8601 अनुरूप मिति भन्दा अघि प्रकाशित पोस्टहरूमा प्रतिक्रिया सीमित गर्ने।','Limit response to posts published after a given ISO8601 compliant date.'=>'दिएको ISO8601 अनुरूप मितिपछि प्रकाशित पोस्टहरूमा प्रतिक्रिया सीमित गर्ने।','Limit result set to specific IDs.'=>'विशिष्ट आईडीहरूमा नतिजा सीमित गर्ने।','Ensure result set excludes specific IDs.'=>'विशिष्ट आईडीहरू बाहेकमा नतिजाहरू सीमित हुने पक्का गर्ने।','Ensure result set excludes comments assigned to specific user IDs. Requires authorization.'=>'विशिष्ट प्रयोगकर्ता आईडीको टिप्पणीहरू अपवर्जित गर्दै परिणाम समूह सुनिश्चित गर्नुहोस्। प्राधिकरण आवश्यक।','Avatar URLs for the comment author.'=>'टिप्पणीको लेखकको लागि अवतार युआरएलहरू।','Limit result set to that from a specific author email. Requires authorization.'=>'एक विशिष्ट लेखक इमेलबाट आएका टिप्पणीहरूमा नतिजा सीमित गर्नुहोस्। प्राधिकरण अनिवार्य छ।','URL to the object.'=>'अब्जेक्ट्को लागि युआरएल ।','HTML content for the post, transformed for display.'=>'पोस्टको लागि एचटिएमएल सामग्री, प्रदर्शन गर्न रुपान्तरण गरिएको ।','The ID for the parent of the post.'=>'पोस्टको प्यारेन्टको लागि आईडी।','The date the post was published, as GMT.'=>'पोस्ट प्रकाशित भएको मिति, जिएमटीको रूपमा।','Content for the post, as it exists in the database.'=>'डाटाबेसमा भए अनुरूपको पोस्टको सामग्री।','The content for the post.'=>'पोस्टको लागि सामग्री।','State of the comment.'=>'टिप्पणीको स्टाटस।','The ID of the associated post object.'=>'सम्बद्ध पोस्ट अब्जेक्टको आईडी।','The comment cannot be deleted.'=>'टिप्पणी मेटाउन सकिएन।','Invalid comment author ID.'=>'अमान्य टिप्पणी लेखक आईडी ।','The ID of the user object, if author was a user.'=>'प्रयोगकर्ता अ