संस्करणसँग नेमस्पेस गरिएको हुनुपर्छ।','Route must be specified.'=>'रुट निर्दिष्ट हुनुपर्छ।','post password formEnter'=>'प्रविष्ट गर्नुहोस्','post statusPublished'=>'प्रकाशित','post statusPrivate'=>'निजी','post statusDraft'=>'ड्राफ्ट','%1$s %2$s %3$s %4$s Feed'=>'%1$s %2$s %3$s %4$s फिड','post statusPending'=>'विचाराधीन','post statusScheduled'=>'अनुसूचित','<strong>Error:</strong> Invalid username, email address or incorrect password.'=>'<strong>त्रुटि:</strong> अमान्य युजरनेम, इमेल ठेगाना वा गलत पासवर्ड।','No logo selected'=>'लोगो चयन गरिएको छैन','Choose logo'=>'लोगो छान्नुहोस्','Close dialog'=>'डाइलग बन्द गर्नुहोस्','The called constructor method for %1$s class in %2$s is <strong>deprecated</strong> since version %3$s! Use %4$s instead.'=>'%2$s क्लासमा %1$s को लागि कल गरिएको कन्स्ट्रक्टर विधि %3$s संस्करणबाट <strong>बहिष्कृत</strong> गरिएको छ! यसको सट्टामा %4$s प्रयोग गर्नुहोस्।','%s is forbidden'=>'%s निषेध छ','Select logo'=>'लोगो चुन्नुहोस्','Change logo'=>'लोगो बदल्नुहोस्','Partial render must echo the content or return the content string (or array), but not both.'=>'आंशिक रेन्डरले या सामग्री प्रदर्शन गर्नुपर्छ या सामग्री स्ट्रिङ (वा एरे) फिर्ता गर्नुपर्छ, तर दुवै होइन।','comment statusApproved'=>'स्वीकृत','comment statusSpam'=>'स्पाम','comment statusTrash'=>'रद्दीटोकरी','<strong>Error:</strong> Your URL is too long.'=>'<strong>त्रुटि:</strong> तपाईँको युआरएल धेरै लामो छ।','<strong>Error:</strong> Your name is too long.'=>'<strong>त्रुटि:</strong> तपाईँको नाम धेरै लामो छ।','<strong>Error:</strong> Your comment is too long.'=>'<strong>त्रुटि:</strong> तपाईँको टिप्पणी धेरै लामो छ।','<strong>Error:</strong> Your email address is too long.'=>'<strong>त्रुटि:</strong> तपाईँको इमेल ठेगाना धेरै लामो छ।','Logo'=>'लोगो','Template is missing. Standalone themes need to have a %1$s or %2$s template file. <a href="%3$s">Child themes</a> need to have a %4$s header in the %5$s stylesheet.'=>'टेम्पलेट छुटेको छ। आत्मनिर्भर थिमहरूमा एक %1$s  वा %2$s टेम्पलेट फाइल हुन अनिव