 are unsure what these terms mean you should probably contact your host. If you still need help you can always visit the <a href="%s">WordPress support forums</a>.'=>'यो शब्दहरूको अर्थ के हो भनेर यदि तपाईँ अनिश्चित हुनुहुन्छ भने तपाईँले सम्भवतः तपाईँको होस्टसँग सम्पर्क गर्नु पर्छ। यदि तपाईँलाई अहिले पनि सहायताको आवश्यकता छ, भने तपाईँ जुनै पनि बेला <a href="%s">वर्डप्रेस सहायता फोरमहरू</a>मा जान सक्नुहुन्छ।','This means that the contact with the database server at %s was lost. This could mean your host&#8217;s database server is down.'=>'यसको मतलब %s मा डाटाबेस सर्भरसँगको सम्पर्क टुट्यो। यसको मतलब तपाईँको होस्टको डाटाबेस सर्भर डाउन भएको हुनसक्छ।','Are you sure you have typed the correct hostname?'=>'के तपाईँ सही होस्टनाम टाइप भएको छ भन्नेमा निश्चित हुनुहुन्छ?','This either means that the username and password information in your %1$s file is incorrect or that contact with the database server at %2$s could not be established. This could mean your host&#8217;s database server is down.'=>'यसको अर्थ यो हो कि या त तपाईको %1$s फाइल मा यूज़रनेम र पासवर्ड को जानकारी गलत छ या हामी %2$s मा डेटाबेस सर्भर संग सम्पर्क गर्न सकिरहेका छैनौ । यसको अर्थ यो हुनसक्छ कि तपाइको होस्टको डेटाबेस सर्भर डाउन छ ।','Are you sure you have the correct username and password?'=>'के तपाईँ निश्चित हुनुहुन्छ कि तपाईँसँग सही युजरनेम र पासवर्ड छ?','If you do not know how to set up a database you should <strong>contact your host</strong>. If all else fails you may find help at the <a href="%s">WordPress support forums</a>.'=>'यदि तपाईँलाई डेटाबेस कसरी स्थापित गर्ने हो भनेर थाह छैन भने तपाईँले <strong>आफ्नो होस्टसंग सम्पर्क गर्नु पर्नेछ</strong>। यदि बाँकी सब विफल भयो भने, तपाईँलाई <a href="%s">वर्डप्रेस सहायता फोरमहरू</a>मा सहायता मिल्न सक्छ।','On some systems the name of your database is prefixed with your username, so it would be like <code>username_%1$s</code>. Could that be the problem?'=>'कुनै सिस्टममा तपाईको डाटाबेसको उपसर्ग तपाईको युजरनेम हुने हुनाले <code>username_%1$s</code> हुने छ​।के त्यो समस्